fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:peatland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :peat_soil ],
        :wetland_ecosystem ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A wetland ecosystem which accumulates acidic peat, a deposit of dead plant material."^^xsd:string ;
    :has_related_synonym "Peatland"^^xsd:string,
        "bog"^^xsd:string,
        "mire"^^xsd:string,
        "morass"^^xsd:string,
        "muskeg"^^xsd:string,
        "peat bog"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:estuary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_overlaps ;
            owl:someValuesFrom :coastal_wetland_ecosystem ],
        [ a owl:Restriction ;
            owl:minQualifiedCardinality "1"^^xsd:nonNegativeInteger ;
            owl:onClass :stream_mouth ;
            owl:onProperty :partially_overlaps ],
        :water_body ;
    :has_broad_synonym "mouth"^^xsd:string ;
    :has_definition "A semi-enclosed coastal body of water with one or more rivers or streams flowing into it, and with a free connection to the open sea."^^xsd:string ;
    :has_related_synonym "inlet"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hedge rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "A dense growth of shrubbery planted as a fence or boundary."^^xsd:string ;
    :has_exact_synonym "HEDGE"^^xsd:string,
        "hedgerow"^^xsd:string ;
    :has_related_synonym "shelter belt"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:navigation_canal rdfs:subClassOf :canal ;
    :has_definition "Artificial watercourse with no flow or a controlled flow used navigation."^^xsd:string ;
    :has_narrow_synonym "navigation canal"^^xsd:string ;
    :has_related_synonym "navigation channel"^^xsd:string,
        "ship cannal"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:geyser rdfs:subClassOf :hot_spring ;
    :has_broad_synonym "thermal feature"^^xsd:string ;
    :has_definition "A hot spring that erupts periodically, ejecting a column of hot water and steam into the air."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hot_spring rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :increased_temperature ] ;
                                    rdf:rest :nil ] ] ] ],
        :spring ;
    owl:disjointUnionOf [ rdf:first :alkaline_hot_spring ;
            rdf:rest [ rdf:first :acidic_hot_spring ;
                    rdf:rest [ rdf:first :neutral_hot_spring ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "spring"^^xsd:string ;
    :has_definition "A spring through which groundwater, heated by geothermal energy, flows."@en ;
    :has_exact_synonym "hotspring"^^xsd:string,
        "thermal spring"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_crater_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :volcanic_crater ],
        :crater_lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :crater_lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :volcanic_crater ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake contained within a volcanic crater."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:freshwater_marsh rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :fresh_water ],
        :marsh ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :marsh ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :overlaps ;
                                                    owl:someValuesFrom :water_body ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :composed_primarily_of ;
                                                            owl:someValuesFrom :fresh_water ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A marsh in which soils are saturated with water that contains low concentrations of salts."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_marsh rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :saline_water ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :water_body ],
        :marsh ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :marsh ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_part ;
                                                    owl:someValuesFrom :water_body ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :composed_primarily_of ;
                                                            owl:someValuesFrom :saline_water ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A marsh whose water contains a considerable quantity of dissolved salts."^^xsd:string ;
    :has_exact_synonym "salt marsh"^^xsd:string ;
    :has_narrow_synonym "salting"^^xsd:string ;
    :has_related_synonym "salt marsh"^^xsd:string,
        "tidal marsh"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_evaporation_pond rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :saline_water ],
        :pond ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A pond which is 1) shallow, 2) man-made, and 3) designed to produce salt from seawater through evaporation."@en ;
    :has_exact_synonym "salt evaporation pond"^^xsd:string ;
    :has_related_synonym "salt pond"^^xsd:string,
        "salt ponds"^^xsd:string,
        "saltern"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fishpond rdfs:subClassOf :lentic_water_body ;
    :has_definition "A pond or lake used for the artificial culture of fish."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mangrove_swamp rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :tropical ;
                            rdf:rest [ rdf:first :subtropical ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ecological_community ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :whole_plant ] ;
                                    rdf:rest :nil ] ] ] ],
        :coastal_wetland_ecosystem ;
    :has_broad_synonym "woodland"^^xsd:string ;
    :has_definition "A swamp which is located in tropical or subtropical environments and is determined by communities of trees and shrubs growing saline coastal environments."^^xsd:string ;
    :has_exact_synonym "mangal"^^xsd:string ;
    :has_related_synonym "MangroveForest"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:underground_lake rdfs:subClassOf :lake,
        :underground_water_body ;
    :has_definition "A lake which is formed under the surface of the Earth. Such a lake may be associated with caves and aquifers and springs."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:underground_river rdfs:subClassOf :river,
        :underground_stream ;
    :has_definition "A river that is under the surface of the Earth."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:underground_stream rdfs:subClassOf :stream,
        :underground_water_body ;
    :has_definition "A stream that is under the surface of the Earth."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:underground_water_body rdfs:subClassOf :water_body ;
    :has_definition "A geographical feature associated with water that is under the surface of the earth."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:populated_place rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :building ],
        [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :homo_sapiens ],
        :environmental_zone ;
    :has_broad_synonym "place"^^xsd:string ;
    :has_definition "Place or area with clustered or scattered buildings and a permanent human population."^^xsd:string ;
    :has_exact_synonym "populated places"^^xsd:string,
        "settlement"^^xsd:string ;
    :has_related_synonym "inhabited region"^^xsd:string,
        "populated locality"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:water_body rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :hydrosphere ],
        :water_mass ;
    :has_broad_synonym "hydrographic feature"^^xsd:string ;
    :has_definition "An accumulation of water of varying size."^^xsd:string ;
    :has_exact_synonym "aquatic feature"^^xsd:string,
        "bodies of water"^^xsd:string,
        "body of water"^^xsd:string,
        "waterbody"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:railway rdfs:subClassOf :transport_feature ;
    :has_broad_synonym "railroad feature"^^xsd:string ;
    :has_definition "A permanent way having one or more rails which provides a track for cars."^^xsd:string ;
    :has_exact_synonym "RAILWAY"^^xsd:string,
        "railroad"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:man_made_tunnel rdfs:subClassOf :tunnel ;
    :has_broad_synonym "tunnel"^^xsd:string,
        "tunnels"^^xsd:string ;
    :has_definition "A tunnel constructed by human means."^^xsd:string ;
    :has_narrow_synonym "canal tunnel"^^xsd:string,
        "railroad tunnel"^^xsd:string,
        "road tunnel"^^xsd:string,
        "underpass"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :cave_wall ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :closure_incomplete ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :cave_floor ],
        :surface_landform ;
    :has_definition "Naturally formed, subterranean open area or chamber."^^xsd:string ;
    :has_related_synonym "cavern"^^xsd:string,
        "grotto"^^xsd:string,
        "notch"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tunnel rdfs:subClassOf :channel ;
    :has_definition "An underground or underwater passage."^^xsd:string ;
    :has_exact_synonym "TUNNEL"^^xsd:string ;
    :has_related_synonym "cave"^^xsd:string,
        "natural tunnel"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:distributary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :distributary_of ;
            owl:someValuesFrom :hydrographic_feature ],
        :stream ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :stream ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :distributary_of ;
                                    owl:someValuesFrom :hydrographic_feature ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "stream"^^xsd:string,
        "watercourse"^^xsd:string ;
    :has_definition "A stream that branches off and flows away from a main stream channel. They are a common feature of river deltas."^^xsd:string ;
    :has_narrow_synonym "stream distributary"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:human_construction rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :technosphere ],
        [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :human_directed_construction_process ],
        :construction ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :material_entity ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :output_of ;
                                    owl:someValuesFrom :human_directed_construction_process ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A construction that has been assembled by deliberate human effort."^^xsd:string ;
    :has_exact_synonym "constructed feature" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fault_cave rdfs:subClassOf :cave ;
    :has_definition "A cave developed along a fault or fault zone, either by movement of the fault or by preferential solution along it."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:aquaduct rdfs:subClassOf :canal ;
    :has_definition "Structure designed to transport water from a remote source, usually by gravity."^^xsd:string ;
    :has_exact_synonym "aqueduct"^^xsd:string ;
    :has_related_synonym "WATERCOURSE BRIDGE"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:building rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :building_part ],
        :human_construction ;
    :has_definition "A permanent walled and roofed construction."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dam rdfs:subClassOf :constructed_barrier ;
    :has_definition "A barrier constructed across a watercourse to control the flow or raise the level of water."^^xsd:string ;
    :has_related_synonym "barrage"^^xsd:string,
        "dam site"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bridge rdfs:subClassOf :transport_feature ;
    :has_definition "A built structure erected over a depression or obstacle to carry traffic or some facility such as a pipeline."^^xsd:string ;
    :has_narrow_synonym "covered bridge"^^xsd:string,
        "footbridge"^^xsd:string,
        "overpass"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mine rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :mining ],
        :human_construction ;
    :has_definition "An excavation in the Earth for the purpose of extracting earth materials."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:agricultural_ecosystem rdfs:subClassOf :ecosystem ;
    owl:equivalentClass [ owl:unionOf [ rdf:first [ owl:intersectionOf [ rdf:first :ecosystem ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :participates_in ;
                                                    owl:someValuesFrom :agricultural_process ] ;
                                            rdf:rest :nil ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :formed_as_result_of ;
                                    owl:someValuesFrom :agricultural_land_conversion_process ] ;
                            rdf:rest :nil ] ] ] ;
    :has_narrow_synonym "barn"^^xsd:string,
        "cattle dipping tank"^^xsd:string,
        "corral"^^xsd:string,
        "dairy"^^xsd:string,
        "feedlot"^^xsd:string,
        "grange"^^xsd:string,
        "grazing allotment"^^xsd:string,
        "irrigated field"^^xsd:string,
        "nursery"^^xsd:string,
        "pastoral site"^^xsd:string,
        "sheepfold"^^xsd:string,
        "stockyard"^^xsd:string ;
    :has_related_synonym "AgriculturalLands"^^xsd:string,
        "agricultural colony"^^xsd:string,
        "agricultural facility"^^xsd:string,
        "agricultural land"^^xsd:string,
        "agricultural reserve"^^xsd:string,
        "agricultural site"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:farm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cropland_biome ;
                            rdf:rest [ rdf:first :rangeland_biome ;
                                    rdf:rest :nil ] ] ] ],
        :agricultural_ecosystem ;
    :has_broad_synonym "agricultural site"^^xsd:string ;
    :has_definition "An area of land which is used for the cultivation of crops or grazing of livestock, including any agricultural constructions therein."^^xsd:string ;
    :has_exact_synonym "FARM"^^xsd:string ;
    :has_related_synonym "farm"^^xsd:string,
        "farms"^^xsd:string,
        "farmstead"^^xsd:string,
        "ranch"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:flume rdfs:subClassOf :canal ;
    :has_broad_synonym "watercourse"^^xsd:string ;
    :has_definition "An open artificial water channel, that leads water from a diversion dam or weir completely aside a natural flow, often an elevated box structure (typically wood) that follows the natural contours of the land."^^xsd:string ;
    :has_exact_synonym "flume (manmade)"^^xsd:string ;
    :has_related_synonym "canal"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mountain_range rdfs:subClassOf [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :mountain ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :mountain ],
        :range_of_mounts ;
    :has_definition "A range of mounts which is dominated by mountains."^^xsd:string ;
    :has_related_synonym "cordillera"^^xsd:string,
        "mountain chain"^^xsd:string,
        "mountain group"^^xsd:string,
        "sierra"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mountain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :volcanic_eruption ;
                            rdf:rest [ rdf:first :tectonic_movement ;
                                    rdf:rest :nil ] ] ] ],
        :mount ;
    :has_definition "A landform that extends above the surrounding terrain in a limited area."^^xsd:string ;
    :has_exact_synonym "Mountain"^^xsd:string ;
    :has_related_synonym "mountains"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
