            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :sediment ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :pebble ;
                                                            rdf:rest [ rdf:first :cobble ;
                                                                    rdf:rest [ rdf:first :sand ;
                                                                            rdf:rest [ rdf:first :gravel ;
                                                                                    rdf:rest [ rdf:first :shell ;
                                                                                            rdf:rest :nil ] ] ] ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :shore ],
        :surface_landform ;
    :has_definition "A landform consisting of loose rock particles such as sand, gravel, shingle, pebbles, cobble, or even shell fragments along the shoreline of a body of water."^^xsd:string ;
    :has_exact_synonym "Beach"^^xsd:string ;
    :has_narrow_synonym "beach berm"^^xsd:string,
        "lagoon beach"^^xsd:string ;
    :has_related_synonym "beach"^^xsd:string,
        "beaches"^^xsd:string,
        "foreshore flats"^^xsd:string,
        "rivage"^^xsd:string,
        "strand"^^xsd:string .

