:sandy_desert rdfs:subClassOf :desert_area ;
    :has_broad_synonym "desert"^^xsd:string,
        "sandy area"^^xsd:string ;
    :has_definition "A desert plain characterized by a surface veneer of sand."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rocky_desert rdfs:subClassOf :desert_area ;
    :has_broad_synonym "desert"^^xsd:string ;
    :has_definition "A desert plain characterized by a surface veneer of rock."^^xsd:string ;
    :has_exact_synonym "rock desert"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:isthmus rdfs:subClassOf :surface_landform ;
    :has_definition "Narrow section of land in a body of water connecting two larger land areas."^^xsd:string ;
    :has_related_synonym "land bridge"^^xsd:string,
        "neck"^^xsd:string,
        "submarine isthmus"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:karst rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :eroding ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :limestone_cave ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :bedrock_dissolution ],
        :surface_landform ;
    :has_definition "A surface landform which is formed by the dissolution of a soluble layer or layers of bedrock."^^xsd:string ;
    :has_related_synonym "karst area"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:elevated_landform rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :slope ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_elevation ],
        :landform ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :landform ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :increased_elevation ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "elevation"@en ;
    :has_definition "A landform elevated above the surrounding area."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:moraine rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :glacial_erosion_process ],
        :surface_landform ;
    :has_definition "An accumulation of boulders, stones, or other debris carried and deposited by a glacier."^^xsd:string ;
    :has_exact_synonym "glacial moraine"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mesa rdfs:subClassOf :flattened_elevation ;
    :has_broad_synonym "plateau"^^xsd:string ;
    :has_definition "An elevated area of land with a flat top and sides that are usually steep cliffs. Mesas form in areas where horizontally layered rocks are uplifted by tectonic activity."^^xsd:string ;
    :has_related_synonym "butte"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mound rdfs:subClassOf :mount ;
    :has_definition "A rounded elevated area."^^xsd:string ;
    :has_related_synonym "mound"^^xsd:string,
        "mount"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nunatak rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :glacier ],
        :peak ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :peak ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :adjacent_to ;
                                    owl:someValuesFrom :glacier ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "glacier feature"^^xsd:string ;
    :has_definition "The exposed summit of a ridge, mountain, or peak not covered with ice or snow within an ice field or glacier. The term is typically used in areas where a permanent ice mass is present."^^xsd:string ;
    :has_related_synonym "mountain summit"^^xsd:string,
        "nunatak"^^xsd:string,
        "nunataks"^^xsd:string,
        "peak"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:plateau rdfs:subClassOf :flattened_elevation ;
    :has_definition "An elevated and comparatively level expanse of land."^^xsd:string ;
    :has_exact_synonym "PLATEAU"^^xsd:string,
        "Plateau"^^xsd:string ;
    :has_related_synonym "highland"^^xsd:string,
        "intermontane plateau"^^xsd:string,
        "plateau"^^xsd:string,
        "table mountain"^^xsd:string,
        "tableknoll"^^xsd:string,
        "tableland"^^xsd:string,
        "tablemount"^^xsd:string,
        "upland"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stony_desert rdfs:subClassOf :desert_area ;
    :has_broad_synonym "desert"^^xsd:string ;
    :has_definition "A desert plain characterized by a surface veneer of gravel or stones."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hanging_valley rdfs:subClassOf :glacial_valley ;
    :has_broad_synonym "valley"^^xsd:string ;
    :has_definition "A tributary valley with the floor at a higher relief than the main channel into which it flows. They are most commonly associated with U-shaped valleys when a tributary glacier flows into a glacier of larger volume."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:raised_mire rdfs:subClassOf :peatland ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "Rain-fed, potentially deep peatlands occurring principally in lowland areas across much of Northern Europe, as well as in the former USSR, North America and parts of the southern hemisphere."^^xsd:string ;
    :has_related_synonym "raised bog"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:string_mire rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :concave ;
                            rdf:rest [ rdf:first :flattened ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:minQualifiedCardinality "3"^^xsd:nonNegativeInteger ;
            owl:onClass :hummock ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :hummock ],
        :peatland ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "Flat or concave peatlands with a string-like pattern of hummocks (hence the name), found principally in northern Scandinavia but occurring in the western parts of the former USSR and in North America. A few examples exist in northern Britain."^^xsd:string ;
    :has_exact_synonym "string bog"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tundra_mire rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :tundra_ecosystem ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :permafrost ],
        :peatland ;
    :has_definition "Peatlands with a shallow peat layer, only about 500 mm thick, dominated by sedges and grasses. They form in permafrost areas, covering around 110,000 to 160,000 km2 in Alaska, Canada, and the former USSR."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:palsa_mire rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :palsa ],
        :peatland ;
    :has_definition "Peatland typified by characteristic high mounds, each with a permanently frozen core, with wet depressions between the mounds."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:peat_swamp rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :forest_ecosystem ],
        :peatland ;
    :has_definition "Forested peatlands including both rain- and groundwater-fed types, commonly recorded in tropical regions with high rainfall."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:abyssal_feature rdfs:subClassOf :undersea_feature ;
    :has_definition "Feature on the ocean floor at a depth of 3500 - 6000 meters."^^xsd:string ;
    :has_related_synonym "Abyssalhill"^^xsd:string,
        "abyssal hill"^^xsd:string,
        "ocean floor feature"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:solid_astronomical_body_part rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :solid_environmental_material ],
        :compound_astronomical_body_part ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :astronomical_body_part ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :solid_environmental_material ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A part of an astronomical body which is primarily composed of a continuous volume of solid material, shaped by one or more environmental processes." ;
    :has_related_synonym "geological feature"^^xsd:string,
        "landform"^^xsd:string,
        "physiographic feature"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mudflat rdfs:subClassOf :coastal_wetland_ecosystem ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A wetland that forms when mud is deposited by the tides, rivers, sea or oceans."^^xsd:string ;
    :has_exact_synonym "mud flat"^^xsd:string ;
    :has_related_synonym "mud flat"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:olive_grove rdfs:subClassOf :plantation ;
    :has_related_synonym "olive grove"^^xsd:string,
        "wood"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:scree rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :rock ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :piece_of_rock ],
        :environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :piece_of_rock ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :derives_from ;
                                            owl:someValuesFrom :rock ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "Broken rock that appears at the bottom of crags, mountain cliffs or valley shoulders."^^xsd:string ;
    :has_related_synonym "TALUS"^^xsd:string,
        "talus slope"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sinkhole rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_broad_synonym "basin"^^xsd:string ;
    :has_definition "A natural depression or hole in the surface topography caused by the removal of soil or bedrock, often both, by water. Sinkholes may vary in size from less than a meter to several hundred meters both in diameter and depth, and vary in form from soil-lined bowls to bedrock-edged chasms."^^xsd:string ;
    :has_related_synonym "cenote"^^xsd:string,
        "sink"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:alkaline_flat rdfs:subClassOf :dry_lake_bed ;
    :has_definition "A dry lakebed consisting of fine-grained sediments infused with alkali salts. Generally the shore or bed of an endorheic lake."^^xsd:string ;
    :has_related_synonym "chott"^^xsd:string,
        "kavir"^^xsd:string,
        "playa"^^xsd:string,
        "salina"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:endorheic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :endorheic_basin ],
        :lake ;
    :has_definition "A lake from which there is no outflow of water, either on the surface as rivers, or underground by flow or diffusion through rock or permeable material."^^xsd:string ;
    :has_exact_synonym "closed lake" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_covered_lake rdfs:subClassOf :glacial_lake ;
    :has_definition "A lake permanently covered by ice."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:meromictic_lake rdfs:subClassOf :lake ;
    owl:disjointWith :holomictic_lake ;
    :has_definition "A lake which has layers of water which do not intermix."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:periglacial_lake rdfs:subClassOf :glacial_lake ;
    :has_definition "A lake, part of whose margin is formed by an ice mass, ice cap or glacier, the ice having obstructed the natural drainage of the land."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fjord_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :fjord ],
        :lake ;
    :has_definition "A lake in a glacially eroded valley, which has been eroded below sea level."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:oxbow_lake rdfs:subClassOf :lake ;
    :has_definition "A lake which is formed when a wide meander from a stream or a river is cut off to form a lake. They are called oxbow lakes due to the distinctive curved shape that results from this process."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rift_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :divergent_tectonic_movement ],
        :tectonic_lake ;
    :has_definition "A lake which fills a depression that has formed as a result of subsidence along a a rift zone, an area of extensional tectonics in the continental crust."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ephemeral_spring rdfs:subClassOf :spring ;
    :has_definition "A spring through which fluid intermittently flows."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:permanent_spring rdfs:subClassOf :spring ;
    :has_definition "A spring whose flow is continuous."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_neritic_zone rdfs:subClassOf :marine_layer ;
    owl:disjointWith :oceanic_zone ;
    :has_definition "The water mass of an ocean directly above a continental shelf."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:oceanic_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ocean ],
        :marine_layer ;
    :has_definition "The water mass of an ocean that is not above a continental shelf."^^xsd:string ;
    :has_exact_synonym "OceanLayer"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_pelagic_zone rdfs:subClassOf :marine_layer ;
    :has_definition "An open ocean region."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_photic_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_photic_zone ],
        :marine_layer ;
    :has_definition "The zone of an ocean from the surface to where photosynthesis can occur, due to the penetration of light."^^xsd:string ;
    :has_exact_synonym "PhoticZone"^^xsd:string,
        "epipelagic zone"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_aphotic_zone rdfs:subClassOf :marine_layer ;
    :has_definition "The zone of an ocean below 200m, in which photosynthesis cannot occur due to the lack of light."^^xsd:string ;
    :has_exact_synonym "AphoticZone"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_bathypelagic_zone rdfs:subClassOf :marine_aphotic_zone ;
    :has_definition "The one of an ocean below the 10degC thermocline down to a temperature of 4degC."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_abyssalpelagic_zone rdfs:subClassOf :marine_aphotic_zone ;
    :has_definition "The zone of the ocean below the bathypelagic zone, with its lowest boundary at about 6000m."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_mesopelagic_zone rdfs:subClassOf :marine_aphotic_zone ;
    :has_definition "The zone of an ocean immediately below the photic zone down to a depth where the water temperature is 10degC (the thermocline)."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hadalpelagic_zone rdfs:subClassOf :marine_aphotic_zone ;
    :has_definition "The zone of an ocean in oceanic trenches, lying between 6000m and 10,000m."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydrothermal_vent rdfs:subClassOf :spring ;
    :has_definition "A fissure in the Earths's surface from which geothermally heated water issues."^^xsd:string ;
    :has_exact_synonym "HydrothermalVents"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fumarole rdfs:subClassOf :geological_fracture ;
    :has_broad_synonym "thermal feature"^^xsd:string ;
    :has_definition "A hole in the Earth's crust from which steam and gases are emitted."^^xsd:string ;
    :has_exact_synonym "FUMAROLE"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:solfatara rdfs:subClassOf :fumarole ;
    :has_definition "A fumarole that emits sulfurous gases."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:black_smoker rdfs:subClassOf :marine_hydrothermal_vent ;
    :has_definition "A hydrothermal vent found on the ocean floor. The vents are formed in fields hundreds of meters wide when superheated water from below the Earth's crust comes through the ocean floor. The superheated water is rich in dissolved minerals from the crust, most notably sulfides, which crystallize to create a chimney-like structure around each vent. When the superheated water in the vent comes in contact with the cold ocean water, many minerals are precipitated, creating the distinctive black color. The metal sulfides that are deposited can become massive sulfide ore deposits in time."^^xsd:string ;
    :has_exact_synonym "active chimney"^^xsd:string ;
    :has_related_synonym "oceanic vent"^^xsd:string,
        "sea vent"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:landlocked_sea rdfs:subClassOf :sea ;
    :disconnected_from :ocean ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A sea that is not connected with an ocean."^^xsd:string ;
    :has_related_synonym "inland sea"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:archipelago rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :island ],
        :compound_astronomical_body_part ;
    :has_definition "A group of geographically or geologically associated islands."^^xsd:string ;
    :has_exact_synonym "ISLAND CLUSTER"^^xsd:string ;
    :has_related_synonym "IslandArc"^^xsd:string,
        "island arc"^^xsd:string,
        "island group"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_island rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :continental_shelf ],
        :island ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :island ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :continental_shelf ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An island that lies on a continental shelf."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:oceanic_island rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :island ;
    :disconnected_from :continental_shelf ;
    :has_definition "An island that does not sit on a continental shelf, and is of volcanic origin."^^xsd:string ;
    :has_related_synonym "volcanic island"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_shelf rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :continental_crust ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :continental_margin ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :continental_slope ],
        :slope ;
    :has_broad_synonym "shelf"^^xsd:string ;
    :has_definition "A slope which a) extends the perimeter of a continent, b) is covered by a shallow marine water body during interglacial periods, c) has a low degree of steepness relative to a continental slope or rise."^^xsd:string ;
    :has_exact_synonym "shelves, continental"^^xsd:string ;
    :has_related_synonym "borderland"^^xsd:string,
        "borderland (continental margin)"^^xsd:string,
        "platform (continental margin)"^^xsd:string,
        "shelf edge (ocean)"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:slightly_stratified_estuary rdfs:subClassOf :estuary ;
    :has_definition "An estuary in which river output is less than the marine input, resulting in the mixing of the whole water column by current-induced turbulence, such that salinity varies more longitudinally rather than vertically."^^xsd:string ;
    :has_exact_synonym "partially mixed estuary",
        "vertically mixed estuary" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:highly_stratified_estuary rdfs:subClassOf :estuary ;
    :has_definition "An estuary whose river output and marine input are more even, with river flow still dominant; turbulence induces more mixing of salt water upward than the reverse."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_wedge_estuary rdfs:subClassOf :estuary ;
    :has_definition "An estuary in which  river output greatly exceeds marine input, resulting in little mixing and thus a sharp contrast between fresh surface water and saline bottom water."^^xsd:string ;
    :has_exact_synonym "salt wedge estuary"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:inverse_estuary rdfs:subClassOf :estuary ;
    :has_definition "An estuary which is located in regions where evaporation greatly exceeds the inflow of fresh water, forming a zone of maximum salinity towards which both riverine and marine water masses flow, before sinking and spreading along the bottom in both seaward and landward directions."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:intermittent_estuary rdfs:subClassOf :estuary ;
    :has_definition "An estuary which varies dramatically in its volume as a result of intermittent freshwater input, and is capable of changing from a wholly marine embayment to any other type of estuary."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:coastal_wetland_ecosystem rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :sea_coast ],
        :wetland_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :wetland_ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :overlaps ;
                                    owl:someValuesFrom :sea_coast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A wetland ecosystem which overlaps both terrestrial and marine ecosystems."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:moor rdfs:subClassOf :freshwater_wetland_ecosystem ;
    :has_broad_synonym "moor"^^xsd:string ;
    :has_definition "A wetland found in upland areas, characterised by acidic soils."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fen rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :fresh_water ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :groundwater ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :alkaline ] ;
                                    rdf:rest :nil ] ] ] ],
        :peatland ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A freshwater peat land with chemically basic (which roughly means alkaline) ground water."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:swamp_ecosystem rdfs:subClassOf :wetland_ecosystem ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A wetland ecosystem in which land mass is permanently inundated by shallow bodies of water, generally with a substantial number of hummocks, or dry-land protrusions."^^xsd:string ;
    :has_exact_synonym "Swamp"^^xsd:string,
        "swamp"^^xsd:string ;
    :has_related_synonym "cienaga"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bayou rdfs:subClassOf :stream ;
    :has_broad_synonym "lake"^^xsd:string,
        "watercourse"^^xsd:string ;
    :has_definition "A small, slow-moving stream or creek; usually located in low-lying areas."^^xsd:string ;
    :has_related_synonym "bahia"^^xsd:string,
        "embayment"^^xsd:string,
        "lake"^^xsd:string,
        "slough"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carr rdfs:subClassOf :fen ;
    :has_definition "A fen which has developed to the point where it supports trees."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dambo rdfs:subClassOf :freshwater_wetland_ecosystem ;
    :has_definition "A class of complex shallow wetlands in central, southern and eastern Africa, particularly in Zambia and Zimbabwe. They are generally found in higher rainfall flat plateau areas, and have river-like branching forms which may be nowhere very large, but common enough to add up to a large area."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydromorphic_phreatic_dambo rdfs:subClassOf :dambo ;
    :has_definition "A danbo associated with a headwater."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fluvial_dambo rdfs:subClassOf :dambo ;
    :has_definition "A dambo associated with a river."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pocasin rdfs:subClassOf :freshwater_wetland_ecosystem ;
    :has_definition "A palustrine wetland with deep, acidic, sandy, peat soils. Groundwater saturates the soil except during brief seasonal dry spells and during prolonged droughts. Pocosin soils are nutrient deficient (oligotrophic), especially in phosphorus."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:saline_wetland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :saline_water ],
        :wetland_ecosystem ;
    :has_definition "A wetland ecosystem in which soil is saturated with saline water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tidal_mudflat rdfs:subClassOf :mudflat ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A level tract lying at a small depth below the surface of water, or alternately covered and left bare by the tide."^^xsd:string ;
    :has_exact_synonym "FLAT"^^xsd:string,
        "tidal flat"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lacustrine_mudflat rdfs:subClassOf :mudflat ;
    :has_definition "A wetland that forms when mud is deposited by a stream."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:freshwater_wetland_ecosystem rdfs:subClassOf [ owl:complementOf [ a owl:Restriction ;
                    owl:onProperty :composed_primarily_of ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_increased_levels_of ;
                                                    owl:someValuesFrom :sodium_chloride ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_landmass ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :soil ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :has_part ;
                                                                            owl:someValuesFrom :fresh_water ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ owl:complementOf [ a owl:Restriction ;
                    owl:onProperty :composed_primarily_of ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_quality ;
                                                    owl:someValuesFrom :increased_osmolarity ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_part ;
                            owl:someValuesFrom :water_body ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :fresh_water ] ;
                            rdf:rest :nil ] ] ],
        :wetland_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :wetland_ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_landmass ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :soil ;
                                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                                    owl:onProperty :has_part ;
                                                                                                    owl:someValuesFrom :fresh_water ] ;
                                                                                            rdf:rest :nil ] ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A wetland which is inundated with water that contains low concentrations of salts."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:abyssal_plain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :continuous_with ;
            owl:someValuesFrom :ocean_floor ],
        :plain ;
    :has_definition "A flat or very gently sloping areas of the deep ocean basin floor."^^xsd:string ;
    :has_exact_synonym "Abyssalplain"^^xsd:string ;
    :has_related_synonym "abyssal feature"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:maar rdfs:subClassOf :crater ;
    :has_definition "A broad, low relief crater that results from a phreatic eruption or explosion caused by groundwater contact with hot lava or magma. The maar typically fills with water to form a relatively shallow crater lake."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_crater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :crater ;
    :has_definition "A crater formed by a volcano, within which occurs a vent (or vents) from which magma erupts as gases, lava, and ejecta."^^xsd:string ;
    :has_related_synonym "crater"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcano rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :geological_fracture ;
    :has_broad_synonym "mount"^^xsd:string ;
    :has_definition "An opening, or rupture, in the Earth's surface or crust, which allows hot, molten rock, ash and gases to escape from deep below the surface."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:glacial_valley rdfs:subClassOf :valley ;
    :has_definition "A valley that contains, or contained, a glacier and was formed by glacial activity. Typically U-shaped in cross-section."^^xsd:string ;
    :has_related_synonym "valley"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lateral_moraine rdfs:subClassOf :moraine ;
    :has_broad_synonym "moraine"^^xsd:string ;
    :has_definition "The parallel ridges of till deposited along the sides of an alglacier. The unconsolidated debris is deposited on top of the glacier by frost shattering of the valley walls and from tributary streams flowing into the valley. The till is carried along the glacial margin until the glacier melts."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:medial_moraine rdfs:subClassOf :moraine ;
    :has_definition "A moriane formed when the inside lateral moraines of two glaciers merge together. They form a ridge down the center of the combined glaciers."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ground_moraine rdfs:subClassOf :moraine ;
    :has_definition "A till covered area with irregular topography and no ridges, often forming gently rolling hills or plains. Forms by the accumulation of till under the ice by lodgement, but may also be deposited as the glacier retreats."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:terminal_moraine rdfs:subClassOf :moraine ;
    :has_definition "Ridges of unconsolidated debris deposited at the snout or end of the glacier. They usually reflect the shape of the glacier's terminus."^^xsd:string ;
    :has_exact_synonym "end moraine"^^xsd:string ;
    :has_related_synonym "delta moraine"^^xsd:string,
        "moraine"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:scroll_plane rdfs:subClassOf :plain ;
    :has_definition "A plain where a stream meanders across an area with a very low gradient, usually with a fairly continuous discharge. In addition to meanders, scroll plains are also characterised by many oxbow lakes."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:till_plain rdfs:subClassOf :plain ;
    :has_definition "An extensive flat plain of glacial till that forms when a sheet of ice becomes detached from the main body of a glacier and melts in place depositing the sediments it carried."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:flood_plain rdfs:subClassOf :plain ;
    :has_definition "An area which is subject to periodic flooding."^^xsd:string ;
    :has_exact_synonym "FLOOD PLAIN"^^xsd:string,
        "Floodplain"^^xsd:string,
        "floodplain"^^xsd:string ;
    :has_related_synonym "bottomland"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:floodway rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :flood_plain ],
        :depressed_landform,
        :surface_landform ;
    :has_definition "The stream channel and adjacent areas that carry flood flows in a flood plain."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:flood_fringe rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :flood_plain ],
        [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :flood ],
        :field ;
    :has_definition "Area of a flood plane covered by the flood, but which does not experience a strong current."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:alluvial_plain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :alluvial_soil ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :range_of_mounts ;
                            rdf:rest [ rdf:first [ owl:complementOf [ a owl:Restriction ;
                                                    owl:onProperty :has_part ;
                                                    owl:someValuesFrom :seamount ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :plain ;
    :has_definition "A relatively flat and gently sloping landform found at the base of a range of hills or mountains, formed by the deposition of alluvial soil over a long period of time by one or more streams coming from the mountains."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lacustrine_plain rdfs:subClassOf :plain ;
    :has_definition "A plain that originally formed in a lacustrine environment, that is, as the bed of a lake, but from which the water has disappeared, by natural drainage, evaporation or other geophysical processes."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:prairie rdfs:subClassOf :grassland_area ;
    :has_definition "An area of land of low topographic relief that historically supported grasses and herbs, with few trees, and having generally a mesic (moderate or temperate) climate. Dominated by tall grasses (contrast steppe)."^^xsd:string ;
    :has_related_synonym "grassland"^^xsd:string,
        "llanos"^^xsd:string,
        "pampa"^^xsd:string,
        "plain"^^xsd:string,
        "veld"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:savanna rdfs:subClassOf :grassland_area ;
    :has_definition "A grassland of the tropics or subtropics with scattered trees."^^xsd:string ;
    :has_exact_synonym "Savanna"^^xsd:string ;
    :has_related_synonym "grassland"^^xsd:string,
        "savannah"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:steppe rdfs:subClassOf :grassland_area ;
    :has_definition "A plain without trees (apart from those near rivers and lakes); it is similar to a prairie, although a prairie is generally considered as being dominated by tall grasses, while short grasses are said to be normal in the steppe. It may be semi-desert, or covered with grass or shrubs or both, depending on the season and latitude."^^xsd:string ;
    :has_related_synonym "grassland"^^xsd:string,
        "pampa"^^xsd:string,
        "pampas"^^xsd:string,
        "puszta"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fissure_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :continuous_with ;
            owl:someValuesFrom :geological_fracture ],
        :cave ;
    :has_definition "A narrow, vertical cave passage, often developed along a joint but not necessarily so. Usually due to solution but sometimes to tension."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:seamount rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_crust ;
                            rdf:rest [ rdf:first [ owl:unionOf [ rdf:first :ocean ;
                                                    rdf:rest [ rdf:first :sea ;
                                                            rdf:rest :nil ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :mountain ;
    :has_broad_synonym "mount"^^xsd:string ;
    :has_definition "A mountain rising from the ocean seafloor that does not reach to the water's surface (sea level), and thus is not an island. Typically formed from volcanoes that rise abruptly and are usually found rising from a seafloor of 1,000 - 4,000 meters depth. Independent features that rise to at least 1,000 meters above the seafloor."^^xsd:string ;
    :has_exact_synonym "mountains"^^xsd:string,
        "sea mount"^^xsd:string,
        "sea-mount"^^xsd:string,
        "seaknoll"^^xsd:string,
        "submarine volcano"^^xsd:string ;
    :has_related_synonym "hill"^^xsd:string,
        "hills"^^xsd:string,
        "knoll"^^xsd:string,
        "knolls"^^xsd:string,
        "mesa"^^xsd:string,
        "mound"^^xsd:string,
        "mount"^^xsd:string,
        "mountain"^^xsd:string,
        "peak"^^xsd:string,
        "peaks"^^xsd:string,
        "range"^^xsd:string,
        "seakpeak"^^xsd:string,
        "undersea hill"^^xsd:string,
        "undersea knoll"^^xsd:string,
        "undersea mound"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:guyot rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :peak ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :flattened ] ;
                                    rdf:rest :nil ] ] ] ],
        :seamount ;
    :has_broad_synonym "seamount"^^xsd:string ;
    :has_definition "A flat-topped seamount."^^xsd:string ;
    :has_exact_synonym "tablemount"^^xsd:string,
        "tablemounts"^^xsd:string ;
    :has_related_synonym "plateau"^^xsd:string,
        "tablemount (seafloor)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pasture rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :farm ;
                            rdf:rest [ rdf:first :ranch ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :agricultural_process ],
        :agricultural_ecosystem,
        :grassland_ecosystem ;
    :has_definition "A grassland ecosystem which is used for grazing of ungulate livestock as part of a farm or ranch."^^xsd:string ;
    :has_related_synonym "grazing area"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:submarine_canyon rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean_floor ;
                            rdf:rest [ rdf:first :sea_floor ;
                                    rdf:rest :nil ] ] ] ],
        :canyon ;
    :has_broad_synonym "canyon"^^xsd:string,
        "canyons"^^xsd:string ;
    :has_definition "A steep-sided valley on the sea floor of the continental slope. Many submarine canyons are found as extensions to large rivers; however there are many that have no such association. Canyons cutting the continental slopes have been found at depths greater than 2 km below sea level. Many submarine canyons continue as submarine channels across continental rise areas and may extend for hundreds of kilometers."^^xsd:string ;
    :has_exact_synonym "SubmarineCanyon"^^xsd:string,
        "undersea canyon"^^xsd:string ;
    :has_related_synonym "undersea ravine"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :lake ],
        :submerged_bed ;
    :has_definition "The ground surface that lies beneath a lake."^^xsd:string ;
    :has_exact_synonym "lake bottom"^^xsd:string ;
    :has_related_synonym "lake"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:land_tied_island rdfs:subClassOf :continental_island ;
    :has_broad_synonym "island"^^xsd:string ;
    :has_definition "A continental island connected to its adjacent land by a natural feature, such as a causeway."^^xsd:string ;
    :has_related_synonym "land-tied island"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:beaver_pond rdfs:subClassOf :pond ;
    :has_definition "A pond that has formed as a consequence of the activities of beavers, building a beaver dam."^^xsd:string ;
    :has_related_synonym "lake"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:chott rdfs:subClassOf :alkaline_flat ;
    :has_definition "A dry (salt) lake in the Saharan area of Africa that stays dry in the summer, but receive some water in the winter. This water may come as a groundwater discharge."^^xsd:string ;
    :has_exact_synonym "shott"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:confluence rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :hydrographic_feature ;
    :has_broad_synonym "stream"^^xsd:string ;
    :has_definition "The point where a tributary joins a more major river."^^xsd:string ;
    :has_related_synonym "stream junction"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_slope rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :continental_margin ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :continental_shelf ],
        :slope ;
    :has_definition "A slope which 1) is part of the seafloor and 2) extends from the end of the continental shelf (the shelf break) to the continental rise."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_rise rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :abyssal_plain ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :continental_slope ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :continental_margin ],
        :slope ;
    :has_definition "A slope which a) bridges, and thus lies between, a continental slope and an abyssal plain, b) is formed by the accumulation of sediments transported from a continental slope by processes including turbidity currents c) has a gradient less than a continental slope yet greater than a continental shelf."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ocean_trench rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean_floor ;
                            rdf:rest [ rdf:first :sea_floor ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ocean ],
        :trench ;
    :has_definition "Hemispheric-scale long but narrow topographic depressions of the sea floor. They are the deepest parts of the ocean floor."^^xsd:string ;
    :has_exact_synonym "Trench"^^xsd:string,
        "deep sea trench"^^xsd:string ;
    :has_related_synonym "deep"^^xsd:string,
        "undersea trench"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:drumlin rdfs:subClassOf :hill ;
    :has_definition "An elongated whale-shaped hill formed by glacial action. Its long axis is parallel with the movement of the ice, with the blunter end facing into the glacial movement. Drumlins are sometimes compared to kames, but their formation is distinctively different. A drumlin is not originally shaped by meltwater, but by the ice itself and has a quite regular shape. It occurs in fine grained material, such as clay or shale, not in sands and gravels. And drumlins usually have concentric layers of material, as the ice successively plasters new layers in its movement."^^xsd:string ;
    :has_related_synonym "mount"^^xsd:string,
        "ridge"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_lake rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A lake that has either permanently or temporally lost its water."^^xsd:string ;
    :has_related_synonym "lake bed"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_stream rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dry ],
        :channel_of_a_watercourse ;
    :has_definition "A stream channel through which no water flows and which has dried, containing no appreciable accumulations of water."^^xsd:string ;
    :has_related_synonym "dry stream bed"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_pan rdfs:subClassOf :dry_lake_bed ;
    :has_definition "A flat expanse of ground covered with salt and other minerals, usually shining white under the sun. A salt pan is formed where water pools. A saline pan would be a lake or a pond if it were located in a climate where the rate of water evaporation were not faster than the rate of water precipitation, i.e., if it were not in a desert. If the water is unable to drain into the ground, it remains on the surface until it evaporates, leaving behind whatever minerals were dissolved. Over thousands of years, the minerals (usually salts) accumulate on the surface."^^xsd:string ;
    :has_exact_synonym "SALT PAN"^^xsd:string,
        "salt pan"^^xsd:string ;
    :has_related_synonym "salt area"^^xsd:string,
        "salt flat"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:escarpment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :tectonic_movement ;
                            rdf:rest [ rdf:first :erosion ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sedimentary_rock ],
        :slope ;
    :has_definition "A slope which separates different physiogeographic provinces that are typically composed of rocks of different age and compositoin."^^xsd:string ;
    :has_exact_synonym "scarp"^^xsd:string ;
    :has_related_synonym "cliff"^^xsd:string,
        "cuesta"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fault_escarpment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :tectonic_movement ],
        :escarpment ;
    :has_definition "An escarpment resulting from a fault."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:esker rdfs:subClassOf :ridge ;
    :has_definition "A long, winding ridge of stratified sand and gravel which occur in glaciated and formerly glaciated regions of Europe and North America."^^xsd:string ;
    :has_related_synonym "ridge"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ridge rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :decreased_thickness ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :elongated ],
        :elevated_landform ;
    :has_definition "A long and narrow elevation with steep sides."^^xsd:string ;
    :has_exact_synonym "RIDGE"^^xsd:string,
        "Ridge"^^xsd:string ;
    :has_narrow_synonym "beach cusp"^^xsd:string,
        "beach ridge"^^xsd:string,
        "icecap ridge"^^xsd:string,
        "rise (seafloor)"^^xsd:string ;
    :has_related_synonym "arete"^^xsd:string,
        "crest"^^xsd:string,
        "cuesta"^^xsd:string,
        "hogback"^^xsd:string,
        "ridge"^^xsd:string,
        "spur"^^xsd:string,
        "spur (physiographic)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:quarry rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :capable_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :rock ] ;
                                    rdf:rest :nil ] ] ] ],
        :open_pit_mine ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :open_pit_mine ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :capable_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_output ;
                                                                    owl:someValuesFrom :rock ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An open-pit mine from which rock or minerals are extracted."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:quicksand_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :quicksand ],
        :surface_layer ;
    :has_definition "A bed which is composed of quicksand forming a soft, shifting mass that yields easily to pressure."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polder rdfs:subClassOf :surface_landform ;
    :has_broad_synonym "physiographic feature"^^xsd:string ;
    :has_definition "An area reclaimed from the sea by diking and draining."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:butte rdfs:subClassOf :flattened_elevation ;
    :has_broad_synonym "plateau"^^xsd:string ;
    :has_definition "An isolated hill with steep sides and a small flat top, smaller than mesas and plateaus. Buttes are formed by erosion when a cap of hard rock, usually of volcanic origin, covers a layer of softer rock that is easily worn away. This hard rock avoids erosion while the rock around it wears down."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cotton_plantation rdfs:subClassOf :plantation ;
    :has_broad_synonym "agricultural site"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:horst rdfs:subClassOf :elevated_landform,
        :surface_landform ;
    :has_definition "The raised fault block bounded by normal faults. The raised block is a portion of the Earth's crust that has remained stationary while the land has sunk on either side of it or has been crushed by a mountain range against it."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:graben rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_definition "A depressed block of land bordered by parallel faults. A graben is the result of a block of land being downthrown producing a valley with a distinct scarp on each side. Grabens often occur side-by-side with horsts. Horst and graben structures are indicative of tensional forces and crustal stretching."^^xsd:string ;
    :has_related_synonym "fault zone"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:drainage_basin rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_definition "An extent or area of land where surface water from rain and melting snow or ice converges to a single point at lower elevation, usually the exit of the basin, where the waters join another waterbody."^^xsd:string ;
    :has_exact_synonym "Basin"^^xsd:string ;
    :has_related_synonym "CATCHMENT"^^xsd:string,
        "Catchment"^^xsd:string,
        "Watershed"^^xsd:string,
        "catchment"^^xsd:string,
        "drainage basin"^^xsd:string,
        "watershed"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:watershed rdfs:subClassOf :solid_astronomical_body_part ;
    :has_definition "The separation between neighbouring drainage basins (catchments). In hilly country, the divide lies along topographical peaks and ridges, but in flat country or on a high plateau (especially where the ground is marshy) the divide may be invisible - just a more or less notional line on the ground on either side of which falling raindrops will start a journey to different rivers, and even to different sides of a country or continent."^^xsd:string ;
    :has_exact_synonym "divide"^^xsd:string,
        "water divide"^^xsd:string ;
    :has_related_synonym "RIDGE LINE"^^xsd:string,
        "divide"^^xsd:string,
        "drainage basin"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_divide rdfs:subClassOf :watershed ;
    :has_definition "A watershed such that water falling on one side of the line eventually travels to one ocean or body of water, and water on the other side travels to another, generally on the opposite side of the continent."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fish_farm rdfs:subClassOf :agricultural_ecosystem ;
    :has_definition "A facility in which fish are raised commercially in tanks or enclosures, usually for food."^^xsd:string ;
    :has_related_synonym "aquacultural site"^^xsd:string,
        "fishery"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fish_hatchery rdfs:subClassOf :hatchery ;
    :has_definition "A hatchery in which the eggs of fish are hatched under artificial conditions."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rice_field rdfs:subClassOf :plantation ;
    :has_definition "A paddy field for the cultivation of rice."^^xsd:string ;
    :has_related_synonym "agricultural site"^^xsd:string,
        "cropland"^^xsd:string,
        "rice paddy"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:paddy_field rdfs:subClassOf :agricultural_field ;
    :has_definition "A flooded parcel of arable land used for growing rice and other semiaquatic crops."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_iceberg rdfs:subClassOf :floating_ice_mass,
        :iceberg ;
    :has_definition "A large mass of detached land ice in the sea or stranded in shallow water."^^xsd:string ;
    :has_exact_synonym "ICEBERG"^^xsd:string ;
    :has_related_synonym "Iceberg"^^xsd:string,
        "arched iceberg"^^xsd:string,
        "glacial berg"^^xsd:string,
        "glacial iceberg"^^xsd:string,
        "iceberg" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water_ice ],
        :cryoform,
        :field ;
    :has_definition "A field of ice, formed in regions of perennial frost."^^xsd:string ;
    :has_narrow_synonym "ice patch"^^xsd:string,
        "iceberg"^^xsd:string,
        "icefall"^^xsd:string ;
    :has_related_synonym "IceSheet"^^xsd:string,
        "ice field"^^xsd:string,
        "ice sheet"^^xsd:string,
        "icecap"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:scrubland_area rdfs:subClassOf :vegetated_area ;
    :has_definition "Area covered with low-growing or stunted perennial vegetation and usually not mixed with trees."^^xsd:string ;
    :has_exact_synonym "scrubland"^^xsd:string ;
    :has_related_synonym "bush"^^xsd:string,
        "chaparal area"^^xsd:string,
        "heath"^^xsd:string,
        "scrub"^^xsd:string,
        "shrubland"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:chaparral_area rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :mediterranean ],
        :scrubland_area ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :scrubland_area ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :mediterranean ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A shrubland area found primarily in regions with a Mediterranean climate (mid, wet winters and hot dry summers) often shaped by wildfires."^^xsd:string ;
    :has_related_synonym "chaparal area"^^xsd:string,
        "maquis"^^xsd:string,
        "woodland"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rift_valley rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :divergent_tectonic_movement ],
        :valley ;
    :has_definition "A valley created by the formation of a rift, i.e. place where a planet's lithosphere is being pulled apart by tectonic forces."^^xsd:string ;
    :has_related_synonym "RiftValley"^^xsd:string,
        "rift zone"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sea_coast rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        :coast ;
    :has_definition "The general region of indefinite width that extends from the sea inland to the first major change in terrain features."^^xsd:string ;
    :has_related_synonym "coast line"^^xsd:string,
        "coastal area"^^xsd:string,
        "coastline"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:shore rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coast ],
        :surface_landform ;
    :has_broad_synonym "coastal zone"^^xsd:string ;
    :has_definition "That part of the land in immediate contact with a body of water including the area between high and low water lines."^^xsd:string ;
    :has_narrow_synonym "shoreface"^^xsd:string ;
    :has_related_synonym "beach face"^^xsd:string,
        "foreshore"^^xsd:string,
        "inshore"^^xsd:string,
        "rivage"^^xsd:string,
        "seashore"^^xsd:string,
        "strand"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:peninsula rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :protruding_out_of ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :water_body ],
        :part_of_a_landmass,
        :surface_landform ;
    :has_definition "A body of land jutting out into and nearly surrounded by water."^^xsd:string ;
    :has_related_synonym "cape"^^xsd:string,
        "foreland"^^xsd:string,
        "head"^^xsd:string,
        "headland"^^xsd:string,
        "hook"^^xsd:string,
        "neck"^^xsd:string,
        "ness"^^xsd:string,
        "point"^^xsd:string,
        "point (physiographic)"^^xsd:string,
        "points"^^xsd:string,
        "promontgory"^^xsd:string,
        "promontory"^^xsd:string,
        "tongue"^^xsd:string,
        "winged headland"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:spit rdfs:subClassOf :bar ;
    :has_definition "A deposition landform found off coasts. A spit is a type of bar or beach that develops where a re-entrant occurs, such as at a cove, bay, ria, or river mouth. Spits are formed by the movement of sediment (typically sand) along a shore by a process known as longshore drift. Where the direction of the shore turns inland (reenters) the longshore current spreads out or dissipates. No longer able to carry the full load, much of the sediment is dropped. This causes a bar to build out from the shore, eventually becoming a spit."^^xsd:string ;
    :has_related_synonym "bar"^^xsd:string,
        "spit"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:icefall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :crevasse ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :glacier ],
        :land_ice_mass ;
    :has_definition "A portion of a glacier characterized by rapid flow, a chaotic crevassed surface, and a pronounced, at times vertical, slope."^^xsd:string ;
    :has_exact_synonym "ice fall"^^xsd:string,
        "ice-fall" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dune_slack rdfs:subClassOf :valley ;
    :has_definition "A valley or trough between two dunes."^^xsd:string ;
    :has_exact_synonym "interdune trough"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:depressed_landform rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :sloped_downward ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :decreased_elevation ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :slope ],
        :landform ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :landform ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :decreased_elevation ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "depression"@en ;
    :has_definition "A landform sunken or depressed below the surrounding area."^^xsd:string ;
    :has_related_synonym "barrier basin"^^xsd:string,
        "depression"^^xsd:string,
        "non tidal basin"^^xsd:string,
        "pan"^^xsd:string,
        "pan (geologic)"^^xsd:string,
        "pans"^^xsd:string,
        "tidal basin"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:meteor_impact_crater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :meterorite_impact ],
        :impact_crater ;
    :has_definition "A crater caused by the impact of a meteor."^^xsd:string ;
    :has_exact_synonym "meteorite crater",
        "meteorite impact crater",
        "meteoroid impact crater" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:kettle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sandur ],
        :depressed_landform,
        :surface_landform ;
    :has_broad_synonym "basin"^^xsd:string ;
    :has_definition "A fluvioglacial landform occurring as the result of blocks of ice calving from the front of a receding glacier and becoming partially to wholly buried by glacial outwash. Glacial outwash is generated when sediment laden streams of meltwater flow away from the glacier and are deposited to form broad outwash plains called sandurs. When the ice blocks melt, holes are left in the sandur."^^xsd:string ;
    :has_exact_synonym "kettle hole"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sandur rdfs:subClassOf :plain ;
    :has_definition "The plain formed by the large amounts of silt and sediment, picked up as a glacier erodes the underlying rocks as it moves slowly downhill, and at the snout of the glacier, meltwater can carry this sediment away from the glacier and deposit it on a broad plain. The material in the outwash plain is often size-sorted by the water runoff of the melting glacier with the finest materials, like silt, being the most distantly re-deposited, whereas larger boulders are the closest to the original terminus of the glacier."^^xsd:string ;
    :has_related_synonym "outwash plain"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:blowout rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_definition "A sandy depression in a sand dune ecosystem (psammosere) caused by the removal of sediments by wind."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:alluvial_fan rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :depositional_process ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :alluvial_plain ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :fan_shaped ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :alluvial_soil ],
        :hydrographic_feature ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :hydrographic_feature ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :fan_shaped ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom :alluvial_plain ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :output_of ;
                                                    owl:someValuesFrom :depositional_process ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :composed_primarily_of ;
                                                            owl:someValuesFrom :alluvial_soil ] ;
                                                    rdf:rest :nil ] ] ] ] ] ] ;
    :has_definition "A fan-shaped deposit formed where a fast flowing stream flattens, slows, and spreads typically at the exit of a canyon onto a flatter plain."^^xsd:string ;
    :has_exact_synonym "fan (alluvial)"^^xsd:string ;
    :has_related_synonym "fan"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bajada rdfs:subClassOf :alluvial_fan ;
    :has_definition "A convergence of neighboring alluvial fans into a single apron of deposits against a slope."^^xsd:string ;
    :has_related_synonym "desert"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:intertidal_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :intertidal_ecosystem ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :shore ],
        :marine_environmental_zone ;
    :has_broad_synonym "coastal zone"^^xsd:string ;
    :has_definition "The area of the foreshore and seabed that is exposed to the air at low tide and submerged at high tide, i.e., the area between tide marks."^^xsd:string ;
    :has_exact_synonym "IntertidalZone"^^xsd:string ;
    :has_related_synonym "littoral zone"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tidal_pool rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :intertidal_zone ],
        :lentic_water_body ;
    :has_definition "Pools formed as a high tide comes in over a rocky shore. Water fills depressions in the ground, which turn into isolated pools as the tide retreats."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:high_tide_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :intertidal_zone ],
        :marine_environmental_zone ;
    :has_definition "The tide zone that is flooded during high tide only, and is a highly saline environment."^^xsd:string ;
    :has_related_synonym "upper littoral"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:low_tide_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :intertidal_zone ],
        :marine_environmental_zone ;
    :has_definition "The tidal zone that is mostly submerged, only being exposed at the point of low tide and for a longer period of time during extremely low tides."^^xsd:string ;
    :has_related_synonym "lower littoral"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:crevasse rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :water_ice ;
                            rdf:rest [ rdf:first :snow ;
                                    rdf:rest :nil ] ] ] ],
        :geological_fracture ;
    owl:disjointWith :crevice ;
    :has_definition "A deep fissure in snow or ice."^^xsd:string ;
    :has_exact_synonym "CREVASSE"^^xsd:string ;
    :has_related_synonym "cleft"^^xsd:string,
        "fissure"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:joint_plane_cave rdfs:subClassOf :cave ;
    :has_definition "A cavity developed along a joint and elongate in cross-section."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_cave rdfs:subClassOf :primary_cave ;
    :has_definition "A cave formed in volcanic rock."^^xsd:string ;
    :has_related_synonym "lava cave"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:live_cave rdfs:subClassOf :cave ;
    :has_definition "A cave containing a stream or active speleothems."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:outflow_cave rdfs:subClassOf :cave ;
    :has_definition "A cave from which a stream flows or formerly did so and which cannot be followed upstream to the surface."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polje rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :closed ],
        :depressed_landform,
        :surface_landform ;
    :has_definition "A large closed depression draining underground, with a flat floor across which there may be an intermittent or perennial stream and which may be liable to flood and become a lake. The floor makes a sharp break with parts of surrounding slopes."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sea_cave rdfs:subClassOf :cave ;
    :has_definition "A cave in present-day or emerged sea cliffs, formed by wave attack or solution."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:speleothem rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cave ],
        :mineral_deposit ;
    :has_definition "A secondary mineral deposit formed in caves, most commonly calcite."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:vadose_zone rdfs:subClassOf :environmental_zone ;
    :has_definition "A zone beneath the land surface and above the level of permanent groundwater or phreatic zone in which water has a hydraulic head less than atmospheric pressure and is retained by a combination of adhesion and capillary action."^^xsd:string ;
    :has_exact_synonym "unsaturated zone"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:phreatic_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :groundwater ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :solid_environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :porous ] ;
                                    rdf:rest :nil ] ] ] ],
        :compound_astronomical_body_part ;
    :has_definition "A compound astronomical body part which is located beneath the land surface and in which all interstices are filled with water that has a hydraulic head greater than atmospheric pressure due to the weight of overlying groundwater."^^xsd:string ;
    :has_related_synonym "zone of saturation"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stalagmite rdfs:subClassOf :speleothem ;
    :has_definition "A speleothem projecting vertically upwards from a cave floor and formed by precipitation from drips."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stalactite rdfs:subClassOf :speleothem ;
    :has_definition "A speleothem hanging downwards from a roof or wall, of cylindrical or conical form, usually with a central hollow tube."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:doline rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :karst ],
        :depressed_landform,
        :subsurface_landform ;
    :has_definition "A closed depression draining underground in karst, of simple but variable form, e.g. cylindrical, conical, bowl- or dish-shaped. From a few to many hundreds of metres in dimensions."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subjacent_karst rdfs:subClassOf :karst ;
    :has_definition "Karst developed in soluble beds underlying other rock formations; the surface may or may not be affected by the karst development."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:syngenetic_karst rdfs:subClassOf :karst ;
    :has_definition "Karst developed in eolian calcarenite when the development of karst features has taken place at the same time as the lithification of dune sand."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polygonal_karst rdfs:subClassOf :karst ;
    :has_definition "Karst completely pitted by closed depressions so that divides between them form a crudely polygonal network."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:doline_karst rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :doline ],
        :karst ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :karst ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :doline ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Karst dominated by closed depressions, chiefly dolines, perforating a simple surface."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:vomit_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :vomit ],
        :bodily_fluid_material ;
    :has_definition "A bodily fluid material which is composed primarily of vomit, a bodily fluid consisting of the expulsed contents of the stomach of an organism disgorged through the mouth or nose."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:piece_of_rock rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :rock ],
        :mass_of_solid_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mass_of_solid_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :rock ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A mass of solid material which is composed primarily of rock."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:particle_of_sand rdfs:subClassOf [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :part_of ;
                            owl:someValuesFrom :sand ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from_part_of ;
                                    owl:someValuesFrom :sand ] ;
                            rdf:rest :nil ] ] ],
        :particle ;
    owl:disjointWith :sand ;
    :has_definition "A particle which 1) is composed primarily of and derived from rock or mineral sources and 2) is or was part of a portion of sand."@en ;
    :has_exact_synonym "grain of sand"@en,
        "granule of sand"@en,
        "sand granule"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:piece_of_gravel rdfs:subClassOf [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :part_of ;
                            owl:someValuesFrom :gravel ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from_part_of ;
                                    owl:someValuesFrom :gravel ] ;
                            rdf:rest :nil ] ] ],
        :piece_of_rock ;
    :has_definition "A piece of rock which is between two and 64 millimetres in length along its largest dimension."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_cap_dome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ice_cap ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :domed ],
        :elevated_landform,
        :surface_landform ;
    :has_broad_synonym "ice mass"^^xsd:string ;
    :has_definition "A comparatively elevated area on an icecap."^^xsd:string ;
    :has_exact_synonym "icecap dome"^^xsd:string ;
    :has_narrow_synonym "icecap dome"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:particle_of_silt rdfs:subClassOf [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :part_of ;
                            owl:someValuesFrom :silt ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from_part_of ;
                                    owl:someValuesFrom :silt ] ;
                            rdf:rest :nil ] ] ],
        :particle ;
    :has_definition "A particle which 1) is primarily composed of quartz or feldspar and 2) is or was part of a portion of silt."@en ;
    :has_exact_synonym "grain of silt"@en,
        "granule of silt"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grain_of_desert_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :desert_sand ],
        :particle_of_sand ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :particle_of_sand ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :desert_sand ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grain_of_beach_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :beach_sand ],
        :particle_of_sand ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :particle_of_sand ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :beach_sand ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grain_of_acid_dune_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :acid_dune_sand ],
        :particle_of_sand ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :particle_of_sand ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :acid_dune_sand ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grain_of_sea_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sea_sand ],
        :particle_of_sand ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :particle_of_sand ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :sea_sand ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grain_of_rocky_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :rocky_sand ],
        :particle_of_sand ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :particle_of_sand ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :rocky_sand ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:terrarium rdfs:subClassOf :vivarium ;
    :has_definition "A terrarium is a vivarium which simulates a terrestrial environment." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:somma_volcano rdfs:subClassOf :volcano ;
    :has_definition "A volcanic caldera that has been partially filled by a new central cone."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_arc rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :archipelago ;
    :has_definition "A chain of volcanic islands or mountains formed by plate tectonics as an oceanic tectonic plate subducts under another tectonic plate and produces magma."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_arc rdfs:subClassOf :volcanic_arc ;
    :has_definition "A volcanic arc formed by the subduction of oceanic crust below continental crust."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:island_arc rdfs:subClassOf :volcanic_arc ;
    :has_definition "A volcanic arc formed by the subduction of oceanic crust other oceanic crust on an adjacent tectonic plate."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :capable_of ;
                    owl:someValuesFrom :volcanic_eruption ] ],
        :geothermally_active_field ;
    :has_definition "A geothermal field which is prone to localized volcanic activity."^^xsd:string ;
    :has_related_synonym "volcanic complex"^^xsd:string,
        "volcanic group"^^xsd:string,
        "volcanic system"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:monogenetic_volcanic_field rdfs:subClassOf :volcanic_field ;
    :has_definition "A volcanic field of small, scattered volcanic vents. These volcanic fields, containing numerous monogenetic volcanoes, are noted for having only one short eruptive event. Monogenetic fields occur only where the magma supply to the volcano is low or where vents are not close enough or large enough to develop plumbing systems for continuous feeding of magma."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pyroclastic_cone rdfs:subClassOf :volcanic_cone ;
    :has_definition "A cone made of material ejected from a volcano. The material can range from finest particles. In comparison, cinder cones are more uniform. They are usually found in or on larger features, such as stratovolcanoes, shield volcanoes and can be found inside calderas, however they can also be an independent feature. They can range from a few metres in height and are usually formed by a single eruption."^^xsd:string ;
    :has_exact_synonym "pyroclastic dome"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lock rdfs:subClassOf :transport_feature ;
    :has_definition "A device for raising and lowering boats between stretches of water of different levels on river and canal waterways. The distinguishing feature of a lock is a fixed chamber whose water level can be varied."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:area_of_protected_biodiversity rdfs:subClassOf :protected_area ;
    :has_broad_synonym "protected area"^^xsd:string ;
    :has_definition "An area of land or of a body of water in which management practices,  through legal or other effective means, prioritise the protection and maintenance of biological diversity, and of natural and associated cultural resources."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:natural_monument rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :protected_area ],
        :natural_environment ;
    :has_broad_synonym "monument"@en ;
    :has_definition "A natural environment which has been designated by a competent authority as having outstanding or unique value because of its rarity, aesthetic qualities, or cultural significance."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:area_of_national_forest rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_broad_synonym "national forest" ;
    :has_definition "A protected forest or woodland area in the United States. National forests are controlled by the federal government and managed by the United States Forest Service, under the direction of the United States Department of Agriculture."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:site_of_special_scientific_interest rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_definition "A conservation designation denoting a protected area in the United Kingdom. SSSIs are the basic 'building block' of nature conservation legislation and most other legal nature/geological conservation designations are based upon them, including National Nature Reserves, Ramsar Sites, Special Protection Areas, and Special Areas of Conservation."^^xsd:string ;
    :has_related_synonym "Area of Special Scientific Interest"^^xsd:string,
        "SSSI"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_park_area rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_broad_synonym "marine park" ;
    :has_definition "A protected area of the sea usually established to preserve a specific habitat and ensure the ecosystem is sustained for the organisms that exist there. Most marine parks are designated by governments, and organized like watery national parks."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:area_designated_as_a_nature_reserve rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_definition "A protected area of importance for wildlife, flora, fauna or features of geological or other special interest, which is reserved and managed for conservation and to provide special opportunities for study or research. Nature reserves may be designated by government institutions in some countries, such as the United Kingdom, or by private landowners, such as charities and research institutions, regardless of nationality."^^xsd:string ;
    :has_related_synonym "natural preserve"^^xsd:string,
        "natural reserve"^^xsd:string,
        "nature preserve"^^xsd:string,
        "nature reserve" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:national_wildlife_refuge rdfs:subClassOf :wildlife_management_area ;
    :has_definition "A designation for certain protected areas of the United States managed by the United States Fish and Wildlife Service. The National Wildlife Refuge system is a network of lands and waters managed to protect wildlife and wildlife habitat."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ramsar_site rdfs:subClassOf :area_designated_as_a_nature_reserve ;
    :has_definition "A wetland protected by the terms of the Ramsar Convention (The Convention on Wetlands of International Importance, especially as Waterfowl Habitat)."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:area_designated_as_a_national_nature_reserve rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_broad_synonym "national nature reserve" ;
    :has_definition "An area of protected biodiversity which is of national significance for biological or Earth science interest."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:iucn_national_park rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "national park" ;
    :has_definition "An IUCN protected area which 1) primarily consists of ecosystems which are able to maintain their natural composition, structure, and function at a regional scale and which are deemed to be representative of a region's natural bio- and geodiversity, 2) is sufficiently large to allow its constituent ecosystems to function, develop, and recover from natural perturbations without human intervention, and 3) is managed to preserve natural ecosystem integrity and functioning at a regional scale, while allowing human access for the purposes of conservation, cultural and spiritural activities, research, education, tourism, subsistence use by indigenous communities, and recreation."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ephemeral_island rdfs:subClassOf :island ;
    :has_definition "An island, usually the consequence of the activity of a submarine volcano, that only exists for a short period or short periods of time after its formation, then being eroded or otherwise disappearing beneath the surface of a body of water."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:brine_pool rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ocean ],
        :hydroform,
        :lentic_water_body ;
    :has_definition """MERGED DEFINITION:
TARGET DEFINITION: A large area of brine on the ocean basin near cold seep vents which release methane into the water. These pools are concentrations of water having an extremely high salinity as compared to the surrounding ocean, caused by the motion of large salt deposits through salt tectonics.
--------------------
SOURCE DEFINITION: Marine brine pools are large areas of brine on the ocean basin. These pools are bodies of water that have a salinity three to five times greater than the surrounding ocean. For deep-sea brine pools the source of the salt is the dissolution of large salt deposits through salt tectonics. The brine often contains high concentrations of methane, providing energy to chemosynthetic animals that live near the pool."""^^xsd:string ;
    :has_exact_synonym "marine brine pool"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tuya rdfs:subClassOf :volcano ;
    :has_definition "A distinctive, flat-topped, steep-sided volcano formed when lava erupts through a thick glacier or ice sheet."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:complex_volcano rdfs:subClassOf :volcano ;
    :has_definition "A volcano with more than one feature. They form because changes of their eruptive characteristics or the location of multiple vents in an area. Stratovolcanoes may form complex volcanoes, because they may overlap another from explosive eruptions, lava flows, pyroclastic flows and by repeated eruptions, to make multiple summits and vents. Stratovolcanoes could also form a large caldera that gets filled in by multiple small cinder cones, lava domes and craters may also develop on the caldera's rim."^^xsd:string ;
    :has_exact_synonym "compound volcano"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pyroclastic_shield_volcano rdfs:subClassOf :shield_volcano ;
    :has_definition "A shield volcano that is formed mostly of pyroclastic and highly explosive eruptions rather than relatively fluid basaltic lava issuing from vents or fissures on the surface of the volcano. They typically display low-angle flank slopes and have little or no central collapse, although a shallow sag in the shield is commonly observed. Lava is commonly extruded after the cessation of explosive activity commonly superposes the vent region."^^xsd:string ;
    :has_exact_synonym "ignimbrite shield volcano",
        "terrestrial ignimbrite shield"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wildlife_management_area rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_definition "A protected area with the purpose of protecting and managing wild life."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:world_heritage_site rdfs:subClassOf :protected_area ;
    :has_definition "A protected area that is a specific site (such as a forest, mountain, lake, desert, monument, building, complex, or city) that has been nominated and confirmed for inclusion on the list maintained by the international World Heritage Programme administered by the UNESCO World Heritage Committee."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:biosphere_reserve rdfs:subClassOf :area_of_protected_biodiversity ;
    :has_definition "An international conservation designation given by UNESCO under its Programme on Man and the Biosphere (MAB)."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:artificial_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :human_directed_construction_process ],
        :human_construction,
        :lake ;
    :has_definition "A lake purposefully constructed."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:canal_head_reservoir rdfs:subClassOf :reservoir ;
    :has_definition "A reservoir constructed for the purpose of maintaining water levels in a canal or canals."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:inundation_disposition rdfs:subClassOf :environmental_disposition ;
    :has_definition "The disposition of an environmental system to be covered by liquid water." ;
    :has_exact_synonym "flooding disposition" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_shelf rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :snowfall ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :mass_ice_flow ],
        [ a owl:Restriction ;
            owl:onProperty :attached_to ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_landmass ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :contained_in ;
                                            owl:someValuesFrom :sea_coast ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :marine_water_body ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :buoyancy ],
        :caro_0000003,
        :land_ice_mass ;
    :has_definition "An ice mass which 1) is attached to the coast 2) at least 2 meters in thickness 3) forms where a glacier or ice mass flows down to a coastline and onto the ocean surface and 4) grows by annual snow accumulation or by the seaward extension of land glaciers."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:massif rdfs:subClassOf :elevated_landform ;
    :has_definition "A section of the Earths's crust that is demarcated by faults or flexures. In the movement of the crust, a massif tends to retain its internal structure while being displaced as a whole."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake_shore rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :lake_coast ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :lake ],
        :shore ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :shore ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :overlaps ;
                                    owl:someValuesFrom :lake_coast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "That part of the land in immediate contact with a lake."^^xsd:string ;
    :has_related_synonym "lakeshore"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stream_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :stream ],
        :submerged_bed ;
    :has_definition "The channel bottom of a stream; the physical confine of the normal water flow."^^xsd:string ;
    :has_exact_synonym "stream bottom"^^xsd:string ;
    :has_narrow_synonym "dry stream bed"^^xsd:string ;
    :has_related_synonym "stream channel"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:river_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :river ],
        :stream_bed ;
    :has_broad_synonym "watercourse"^^xsd:string ;
    :has_definition "The channel bottom of a river; the physical confine of the normal water flow."^^xsd:string ;
    :has_exact_synonym "river bottom"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stream_mouth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :hydroform,
        :mouth ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mouth ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :stream ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "stream"^^xsd:string ;
    :has_definition "The place where a stream discharges into a lagoon, lake, or the sea."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:river_mouth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :river ],
        :stream_mouth ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mouth ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :river ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The end of a stream where it enters a standing water body such as a lake, sea or ocean."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:container_of_an_intermittent_lake rdfs:subClassOf :container_of_an_intermittent_water_body ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A depression which intermittently contains a lake."^^xsd:string ;
    :has_exact_synonym "intermittent lake"^^xsd:string,
        "intermittent lakes"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:intermittent_wetland rdfs:subClassOf :wetland_ecosystem ;
    :has_definition "A wetland ecosystem which is sometimes inundated or saturated by surface or ground water sufficient to support, and that under normal circumstances do support, a prevalence of vegetation typically adapted for life in saturated soil conditions."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mountain_spur rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mountain ],
        :spur ;
    :has_definition "A spur which is part of a mountain."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:land_bridge rdfs:subClassOf :isthmus ;
    :has_definition "An isthmus or other land connection between what at other times are separate land masses which allows animals and plants to cross and colonise new lands. Land bridges are commonly created by regression, in which sea levels fall exposing previously submerged sections of continental shelf. Land bridges are also formed by: (a) upthrust at the edge of continental plates; and (b) glacial retreat alleviating pressure on shallow marine formations."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_tongue rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :valley_glacier ],
        :floating_ice_mass,
        :land_ice_mass ;
    :has_definition "A long and narrow sheet of ice projecting out from the coastline. An ice tongue forms when a valley glacier moves very rapidly out into the ocean or a lake."^^xsd:string ;
    :has_exact_synonym "glacier tongue"^^xsd:string ;
    :has_related_synonym "glacial tongue"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sound rdfs:subClassOf :coastal_inlet ;
    :has_definition "A large sea or ocean inlet larger than a bay, deeper than a bight, wider than a fjord, or it may identify a narrow sea or ocean channel between two bodies of land."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:strait rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :connects ;
            owl:someValuesFrom :water_body ],
        :channel_of_a_watercourse ;
    :has_broad_synonym "channel"^^xsd:string,
        "watercourse"^^xsd:string ;
    :has_definition "A narrow channel of water that connects two larger bodies of water, and thus lies between two land masses."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:channel_of_a_watercourse rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :bank ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :submerged_bed ],
        :depressed_landform ;
    :has_definition "A depressed landform which physically confines a river, slough or ocean strait, and which consists of a bed and banks."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_channel rdfs:subClassOf :channel_of_a_watercourse ;
    :has_definition "A channel of a watercourse which contains marine water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lake_channel rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :lake ],
        :channel_of_a_watercourse ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :channel_of_a_watercourse ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :location_of ;
                                    owl:someValuesFrom :lake ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A channel of a watercourse which contains lake water."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_cone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :conical ],
        :elevated_landform,
        :volcanic_feature ;
    :has_broad_synonym "cone"^^xsd:string ;
    :has_definition "Built by fragments (called ejecta) thrown up (ejected) from a volcanic vent, piling up around the vent in the shape of a cone with a central crater."^^xsd:string ;
    :has_exact_synonym "lava cone"^^xsd:string ;
    :has_related_synonym "cone (geological)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ash_cone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :volcanic_ash ],
        :volcanic_cone ;
    :has_definition "A cone that is composed of particles of silt to sand size. Explosive eruptions from a vent where the magma is interacting with groundwater or the sea (as in an eruption off the coast) produce steam and are called phreatic. The interaction between the magma, expanding steam, and volcanic gases results in the ejection of mostly small particles called ash. Fallen ash has the consistency of flour. The unconsolidated ash forms an ash cone which becomes a tuff cone or tuff ring once the ash consolidates."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cinder_cone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :tephra ;
                            rdf:rest [ rdf:first :scoria ;
                                    rdf:rest [ rdf:first :pumice ;
                                            rdf:rest :nil ] ] ] ] ],
        :volcanic_cone ;
    :has_definition "A cone built almost entirely of loose volcanic fragments called cinders (pumice, pyroclastics, or tephra). They are built from particles and blobs of congealed lava ejected from a single vent. As the gas-charged lava is blown violently into the air, it breaks into small fragments that solidify and fall as cinders around the vent to form a circular or oval cone. Most cinder cones have a bowl-shaped crater at the summit."^^xsd:string ;
    :has_related_synonym "mount"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:spatter_cone rdfs:subClassOf :volcanic_cone ;
    :has_definition "A volcanic cone formed of molten lava ejected from a vent somewhat like taffy. Expanding gases in the lava fountains tear the liquid rock into irregular gobs that fall back to earth, forming a heap around the vent. The still partly liquid rock splashed down and over the sides of the developing mound is called spatter. Because spatter is not fully solid when it lands, the individual deposits are very irregular in shape and weld together as they cool, and in this way particularly differ from cinder and ash."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mud_volcano rdfs:subClassOf :volcano ;
    :has_definition "A volcano created by geologically excreted liquids and gases, although there are several different processes which may cause such activity. Temperatures are much cooler than igneous processes."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:shield_volcano rdfs:subClassOf :volcano ;
    :has_definition "A large volcano with shallowly-sloping sides."^^xsd:string ;
    :has_related_synonym "mount"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stratovolcano rdfs:subClassOf :volcano ;
    :has_definition "A tall, conical volcano composed of many layers of hardened lava, tephra, and volcanic ash. These volcanoes are characterized by a steep profile and periodic, explosive eruptions. The lava that flows from them is viscous, and cools and hardens before spreading very far. The source magma of this rock is classified as acidic, or high in silica to intermediate (rhyolite, dacite, or andesite)."^^xsd:string ;
    :has_related_synonym "composite volcano"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mid_ocean_ridge rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :divergent_tectonic_movement ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ocean ],
        :range_of_seamounts ;
    :has_definition "An underwater mountain range, formed by plate tectonics. This uplifting of the ocean floor occurs when convection currents rise in the mantle beneath the oceanic crust and create magma where two tectonic plates meet at a divergent boundary. The mid-ocean ridges of the world are connected and form a single global mid-oceanic ridge system that is part of every ocean."^^xsd:string ;
    :has_related_synonym "OceanRidge"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subglacial_volcano rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :glacier ;
                            rdf:rest [ rdf:first :glacial_lake ;
                                    rdf:rest :nil ] ] ] ],
        :volcano ;
    :has_definition "A volcano produced by subglacial eruptions or eruptions beneath the surface of a lake melted into a glacier or ice mass by the rising lava."^^xsd:string ;
    :has_related_synonym "tuya"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_fissure rdfs:subClassOf :volcano ;
    :has_definition "A linear volcanic vent through which lava erupts, usually without any explosive activity. The vent is usually a few meters wide and may be many kilometers long. Fissure vents can cause large flood basalts and hannels. The volcano can usually be seen as a crack in the ground or on the ocean floor. Narrow fissures can be filled in with lava that hardens."^^xsd:string ;
    :has_related_synonym "fissure"^^xsd:string,
        "fissure vent"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:whirlpool rdfs:subClassOf :marine_current ;
    :has_broad_synonym "hydrographic feature"^^xsd:string ;
    :has_definition "A large, swirling body of water produced by ocean tides."^^xsd:string ;
    :has_exact_synonym "WHRL"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:kipuka rdfs:subClassOf :elevated_landform,
        :surface_landform ;
    :has_definition "An elevated area such as a hill, ridge or old lava dome inside or downslope from an area of active volcanism. New lava flows will cover the surrounding land, isolating the kipuka so that it appears as a (usually) forested island in a barren lava flow."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ford rdfs:subClassOf :transport_feature ;
    :has_broad_synonym "transportation feature"^^xsd:string ;
    :has_definition "The shallow part of a stream which can be easily crossed."^^xsd:string ;
    :has_exact_synonym "ford (crossing)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tidal_watercourse rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :tidal_flow_process ],
        :watercourse ;
    :has_definition "A watercourse which has the intensity and direction of its flow primarily determined by the tides." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pingo rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :soil ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :ice_mass ],
        :elevated_landform,
        :surface_landform ;
    :has_broad_synonym "mount"^^xsd:string ;
    :has_definition "A mound of earth-covered ice found in the Arctic, subarctic, and Antarctica that can reach up to 70 metres in height and up to 2 kilometres in diameter."^^xsd:string ;
    :has_exact_synonym "hydrolaccolith"^^xsd:string,
        "pingos"^^xsd:string ;
    :has_related_synonym "bugor"^^xsd:string,
        "bulginniakh"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:natural_arch rdfs:subClassOf :surface_landform ;
    :has_definition "A natural formation where a rock arch forms, with a natural passageway through underneath."^^xsd:string ;
    :has_exact_synonym "arches (natural formation)"^^xsd:string,
        "natural bridge"^^xsd:string ;
    :has_related_synonym "sea arch"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:raised_beach rdfs:subClassOf :beach ;
    :has_definition "A beach or wave cut platform raised above the shore line by a relative fall in the sea level."^^xsd:string ;
    :has_related_synonym "terrace"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coastal_dune rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sea_coast ],
        :dune ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :dune ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :sea_coast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A dune which is part of a coast."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:machair rdfs:subClassOf :raised_beach ;
    :has_definition "A fertile low-lying raised beach found on the some of the coastlines of Ireland and Scotland, in particular in the Outer Hebrides."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ria rdfs:subClassOf :valley ;
    :has_definition "A submergent coastal landform that forms where sea levels rise relative to the land either as a result of eustatic sea level change; where the global sea levels rise or isostatic sea level change; where the land sinks. When this happens valleys which were previously at sea level become submerged."^^xsd:string ;
    :has_related_synonym "drowned river valley"^^xsd:string,
        "drowned valley"^^xsd:string,
        "valley"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stack rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :rock ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :columnar ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :sea_coast ],
        [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        :elevated_landform,
        :surface_landform ;
    :has_definition "A geological landform consisting of a steep and often vertical column or columns of rock in the sea near a coast."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tombolo rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:unionOf [ rdf:first :ocean ;
                                            rdf:rest [ rdf:first :sea ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :island ;
                                                            rdf:rest [ rdf:first :rocky_reef ;
                                                                    rdf:rest [ rdf:first :shore ;
                                                                            rdf:rest :nil ] ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :depositional_process ],
        :bar ;
    :has_definition "A deposition landform such as a spit or bar which forms a narrow piece of land between an island or offshore rock and a mainland shore, or between two islands or offshore rocks. They usually form because the island causes wave refraction, depositing sand and shingle moved by longshore drift in each direction around the island where the waves meet. Eustatic sea level rise may also contribute to accretion as material is pushed up with rising sea levels."^^xsd:string ;
    :has_related_synonym "bar"^^xsd:string,
        "island"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wave_cut_platform rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sea_cliff ],
        :surface_landform ;
    :has_definition "The narrow flat area often seen at the base of a sea cliff caused by the action of the waves."^^xsd:string ;
    :has_related_synonym "marine terrace"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:limestone_pavement rdfs:subClassOf :karst ;
    :has_definition "A natural karst landform consisting of a flat, incised surface of exposed limestone that resembles artificial pavement."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:river_island rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :river ],
        :island ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :island ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :river ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An island that lies in a river."^^xsd:string ;
    :has_related_synonym "ait"^^xsd:string,
        "eyot"^^xsd:string,
        "fluvial island"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake_island rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :lake ],
        :island ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :island ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :lake ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An island that lies in a lake."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ocean_floor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ocean ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ocean_basin ],
        :marine_bed ;
    :has_definition "A marine bed which lies below an ocean."^^xsd:string ;
    :has_exact_synonym "ocean bed"^^xsd:string ;
    :has_related_synonym "ocean floor feature"^^xsd:string,
        "seafloor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:meander rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :liquid_astronomical_body_part ;
    :has_broad_synonym "watercourse"^^xsd:string ;
    :has_definition "A bend in a stream. A stream flowing through a wide valley or flat plain will tend to form a meanders as it alternatively erodes and deposits sediments along its course."^^xsd:string ;
    :has_narrow_synonym "stream"^^xsd:string ;
    :has_related_synonym "oxbow loop"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:biome rdfs:subClassOf [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :habitat ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :habitat ],
        [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :ecological_community ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :biosphere ],
        :ecosystem ;
    owl:disjointWith :ecoregion,
        :ecozone ;
    :has_definition "A biome is an ecosystem to which resident ecological communities have evolved adaptations."^^xsd:string ;
    :has_exact_synonym "major habitat type"^^xsd:string ;
    :has_related_synonym "EcosytemType"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:arete rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :slender ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cirque ;
                            rdf:rest [ rdf:first :glacial_valley ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :glacial_erosion_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :angular ],
        :ridge ;
    :has_definition "A ridge which is jagged, narrow and separates glacier valleys or cirques."@en ;
    :has_related_synonym "ridge"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dirt_cone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :melting ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_participant ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_ice ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :part_of ;
                                                                            owl:someValuesFrom :glacier ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ice_mass ],
        [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :depositional_process ],
        :surface_landform ;
    :has_definition "A feature of a glacier, in which dirt, which has fallen into a hollow in the ice, forms a coating which insulates the ice below. The surrounding ice melts away, leaving the dirt cone."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:drumlin_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :drumlin ],
        :hill_range ;
    :has_definition "A cluster of dozens to hundreds of similarly shaped, sized and oriented drumlins."^^xsd:string ;
    :has_related_synonym "drumlin swarm"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:monadnock rdfs:subClassOf :mount ;
    :has_definition "An isolated hill, knob, ridge, or small mountain that rises abruptly from a gently sloping or virtually level surrounding plain."^^xsd:string ;
    :has_related_synonym "inselberg"^^xsd:string,
        "kopje"^^xsd:string,
        "mount"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:kame_terrace rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :kame ],
        :terrace ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :terrace ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :kame ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A terrace associated with a kame."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:outwash_fan rdfs:subClassOf :plain ;
    :has_definition "A fan-shaped body of sediments deposited by braided streams from a melting glacier."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:proglacial_lake rdfs:subClassOf :glacial_lake ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A lake formed either by the damming action of a moraine or ice dam during the retreat of a melting glacier, or one formed by meltwater trapped against an ice mass due to isostatic depression of the crust around the ice."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tunnel_valley rdfs:subClassOf :glacial_valley ;
    :has_definition "A deep but narrow valley with a 'U' shaped cross-section and frequently a 'U' shaped plan which is usually found filled with glacial till. It is formed when the edge of an ice mass advances up a slope. Its length may be appropriately measured in centimetres or kilometres, depending on the circumstances of formation."^^xsd:string ;
    :has_related_synonym "rinnental"^^xsd:string,
        "tunnel-vale"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nye_channel rdfs:subClassOf :tunnel_valley ;
    :has_definition "A small tunnel valley."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:alas rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_definition "A steep-sided depression formed by the melting of permafrost; it may contain a lake."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dell rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :u_shaped ;
                            rdf:rest [ rdf:first :v_shaped ;
                                    rdf:rest :nil ] ] ] ],
        :valley ;
    :has_broad_synonym "valley"^^xsd:string ;
    :has_definition "A small wooded valley, either U- or V-shaped."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rock_shelter rdfs:subClassOf :cave ;
    :has_definition "A shallow cave-like opening at the base of a bluff or cliff."^^xsd:string ;
    :has_related_synonym "rockhouse"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:terracette rdfs:subClassOf :ridge ;
    :has_definition "A ridge on a hillside formed when saturated soil particles expand, then contract as they dry, causing them to move slowly downhill."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:maelstrom rdfs:subClassOf :whirlpool ;
    :has_definition "A very powerful whirlpool."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:flood_control_reservoir rdfs:subClassOf :reservoir ;
    :has_definition "A reservoir constructed for the purpose of containing a flood, an overflow of water from a body of water that sumerges land."^^xsd:string ;
    :has_exact_synonym "flood control basin"^^xsd:string ;
    :has_related_synonym "retention basin"^^xsd:string,
        "storage basin"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:woodland_clearing rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :woodland_area ;
                            rdf:rest [ rdf:first :forested_area ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :exposed ],
        :field ;
    :has_definition "A tract of land which has few or no trees and is surrounded by more heavily wooded areas."^^xsd:string ;
    :has_exact_synonym "CLEARING"^^xsd:string,
        "clearing"^^xsd:string ;
    :has_narrow_synonym "forest clearing"^^xsd:string ;
    :has_related_synonym "burn"^^xsd:string,
        "burnt over area"^^xsd:string,
        "clearing"^^xsd:string,
        "cut line"^^xsd:string,
        "fire break"^^xsd:string,
        "glade"^^xsd:string,
        "grassland"^^xsd:string,
        "logged area"^^xsd:string,
        "opening" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:transvasement rdfs:subClassOf :aquaduct ;
    :has_definition "An aquaduct to transport water from one river basin to another one, to solve problems of hydrographic imbalance. It can decrease floods, moving the water to lands with droughts."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:terrestrial_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :planetary_landmass ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :planetary_landmass ] ;
                                    rdf:rest :nil ] ] ] ],
        :biome ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :biome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :planetary_landmass ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :part_of ;
                                                                    owl:someValuesFrom :planetary_landmass ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A biome which is  primarily or completely situated on a landmass."^^xsd:string ;
    :has_related_synonym "terrestrial realm"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_biome rdfs:subClassOf :aquatic_biome,
        :marine_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_biome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :marine_water_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An aquatic biome which is determined by a marine water body."^^xsd:string ;
    :has_related_synonym "marine realm"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydroelectric_reservoir rdfs:subClassOf :reservoir ;
    :has_definition "A reservoir constructed for the purpose of generating electricity."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:drinking_water_reservoir rdfs:subClassOf :reservoir ;
    :has_definition "A reservoir constructed for the purpose of providing drinking water."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:irrigation_reservoir rdfs:subClassOf :reservoir ;
    :has_definition "A reservoir constructed for the purpose of providing water for irrigation."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:amenity_lake rdfs:subClassOf :artificial_lake ;
    :has_definition "A lake constructed, or modified, for the chief purpose of providing an amenity."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ribbon_lake rdfs:subClassOf :lake ;
    :has_definition "A lake that is long, narrow, and finger-shaped, usually found in a glacial trough. Its formation begins when a glacier moves over an area containing alternate bands of hard and soft bedrock. The sharp-edged boulders carried at the bottom of the glacier erode the softer rock more quickly by abrasion, thus creating a hollow called a rock basin. On either side of the rock basin, the more resistant rock is eroded less and these outcrops of harder rock are known as rock bars, which act as dams between which rainwater may accumulate after the retreat of the ice age, filling up the rock basin and creating a ribbon lake. A ribbon lake may also form behind a terminal or recessional moraine, both of which also act as dams, enabling water to accumulate behind them. A ribbon lake may also occur if a tributary glacier joins a main glacier. The increase in power can create a trough, which is filled with water from a river/meltwater to create a ribbon lake."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:liman rdfs:subClassOf :lentic_water_body ;
    :has_definition "A lake or estuary that is formed at the mouth of a river where flow is blocked by a bar of sediments. It can be maritime (the bar being created by the current of a sea) or fluvial (the bar being created by the flow of a bigger river at the confluence)."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:turlough rdfs:subClassOf :container_of_an_intermittent_lake ;
    :has_definition "A container of an intermittent lake unique to the limestone areas of Ireland, mostly west of the River Shannon. Most turloughs flood in the autumn, usually some time in October, and then dry up some time between April and July."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tarn rdfs:subClassOf :lake ;
    :has_definition "A mountain lake that is formed in a cirque excavated by a glacier. A moraine may form a natural dam below a tarn."^^xsd:string ;
    :has_exact_synonym "corrie loch"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tidewater_glacier rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ocean ],
        :glacier ;
    :has_definition "A glacier which terminates in a lake or the sea, with terminus either floating or grounded"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:plateau_glacier rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :plateau ],
        :glacier ;
    :has_definition "A glacier on a plateau or high area, smaller than an ice sheet."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:valley_glacier rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :valley ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :valley ],
        :glacier ;
    :has_definition "A glacier which 1) flows for all or most of its length within the walls of a valley, in consequence having a distinct tongue and a well-defined outline and 2) descends from either high mountains, from an ice cap on a plateau, or from an ice sheet."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:outlet_glacier rdfs:subClassOf :glacier ;
    :has_definition "A glacier fed by an ice sheet."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:penplain rdfs:subClassOf :plain ;
    :has_definition "A region of low topographic relief as a consequence of erosion by streams."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pseudocrater rdfs:subClassOf :crater ;
    :has_definition "A volcanic landform which resembles a true volcanic crater, but differs in that it is not an actual vent from which lava has erupted. A pseudocrater is characterised by the absence of any magma conduit which connects below the surface of the earth. Pseudocraters are formed by steam explosions as flowing hot lava crosses over a wet surface, such as a swamp, a lake, or a pond. The explosive gases break through the lava surface in a manner similar to a phreatic eruption, and the tephra builds up crater-like forms which can appear very similar to real volcanic craters."^^xsd:string ;
    :has_exact_synonym "rootless vent"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polygenetic_volcanic_field rdfs:subClassOf :volcanic_field ;
    :has_definition "A volcanic field of scattered volcanic vents. These volcanic fields, containing numerous polygenetic volcanoes, are noted for having more than one eruptive event from the same vent(s), rather than the more common monogenetic volcanic field. Polygenetic volcanic fields generally occur where there is a high-level magma chamber. These volcanic fields may show lithological discontinuities due to major changes in magma chemistry, volcanotectonic events, or long erosional intervals, and may last >10 million year period."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:harbour rdfs:subClassOf :surface_landform ;
    :has_definition "A landform which provides shelter from atmospheric weather and marine currents, waves, and other dynamics."^^xsd:string ;
    :has_exact_synonym "harbor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:artificial_harbor rdfs:subClassOf :harbour,
        :human_construction ;
    :has_definition "A harbor constructed by human agency."^^xsd:string ;
    :has_exact_synonym "artificial harbour"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:natural_harbor rdfs:subClassOf :harbour ;
    :has_definition "A harbor which is formed by a natural landform where a part of a body of water is protected and deep enough to furnish anchorage."^^xsd:string ;
    :has_exact_synonym "natural harbour"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:university_campus rdfs:subClassOf [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :building ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :building ],
        :educational_facility ;
    :has_broad_synonym "campus"^^xsd:string ;
    :has_definition "An area of land on which a college or university and related institutional buildings are situated."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydroelectric_dam rdfs:subClassOf :dam ;
    :has_definition "A dam constructed for the purpose of generating electricity from the water stored behind it."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:research_facility rdfs:subClassOf :human_construction ;
    :has_definition "A facility, permanent or temporary, on land, in air, space or water, where scientific research or measurements can be undertaken."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:irrigation_dam rdfs:subClassOf :dam ;
    :has_definition "A dam constructed for the purpose of holding water in a reservoir for irrigation."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:flood_control_dam rdfs:subClassOf :dam ;
    :has_definition "A dam constructed for the purpose of controlling flooding."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:backwater rdfs:subClassOf :watercourse ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "An area of calm water unaffected by the current of a stream."^^xsd:string ;
    :has_exact_synonym "BACKWATER"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:gravel_pit rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :capable_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :gravel ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :gravel ],
        :quarry ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :quarry ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :capable_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_output ;
                                                                    owl:someValuesFrom :gravel ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A quarry from which gravel is extracted."^^xsd:string ;
    :has_related_synonym "mine site"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cut rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "An excavation of the Earth's surface to provide passage for a road, railway, canal, etc."^^xsd:string ;
    :has_exact_synonym "CUT"^^xsd:string,
        "cutting"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:inlet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :planetary_landmass ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :water_body ],
        :hydrographic_feature ;
    :has_definition "An opening of the sea into the land, or of a lake into its shore."^^xsd:string ;
    :has_related_synonym "anse"^^xsd:string,
        "arm"^^xsd:string,
        "firth"^^xsd:string,
        "ria"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake_inlet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :lake ],
        :inlet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :inlet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :lake ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An opening of a lake into its shore."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mount rdfs:subClassOf :elevated_landform ;
    :has_definition "A mountain or a hill."^^xsd:string ;
    :has_related_synonym "cerrito"^^xsd:string,
        "cerro"^^xsd:string,
        "dome"^^xsd:string,
        "koppje"^^xsd:string,
        "monadnock"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:range_of_mounts rdfs:subClassOf [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :mount ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :mount ],
        :field ;
    :has_definition "A field which includes at least two mounts connected by high ground and arranged in an approximately linear fashion."@en ;
    :has_related_synonym "range (physiographic)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mouth rdfs:subClassOf [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :water_body ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :water_body ],
        :watercourse ;
    :has_definition "The exit or point of discharge of a stream into another stream, lake or sea."^^xsd:string ;
    :has_exact_synonym "MOUTH"^^xsd:string ;
    :has_related_synonym "outlet"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:peak rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :elevated_landform ],
        :landform ;
    :has_definition "The summit of a mount."^^xsd:string ;
    :has_exact_synonym "peaks"^^xsd:string ;
    :has_related_synonym "ahu"^^xsd:string,
        "ice peak"^^xsd:string,
        "mountain crest"^^xsd:string,
        "mountain summit"^^xsd:string,
        "nunatak"^^xsd:string,
        "summit"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pinnacle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :protruding_out_of ],
        :elevated_landform ;
    :has_broad_synonym "natural rock formation"^^xsd:string ;
    :has_definition "A tall, slender, spire-shaped rock projecting from a level or more gently sloping surface."^^xsd:string ;
    :has_exact_synonym "PINNACLE"^^xsd:string,
        "pinnacle (natural formation)"^^xsd:string ;
    :has_related_synonym "chapeirao"^^xsd:string,
        "coral head"^^xsd:string,
        "crag"^^xsd:string,
        "pillar"^^xsd:string,
        "scar"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sea_floor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :sea ],
        :marine_bed ;
    :has_definition "A marine bed which lies below a sea."^^xsd:string ;
    :has_exact_synonym "SeaFloor"^^xsd:string,
        "Meeresboden"@de,
        "ocean floor"@en,
        "seabed"@en,
        "seafloor"@en,
        "fondo marino"@es,
        "fondale marino"@it ;
    :has_related_synonym "sea bed"^^xsd:string,
        "ocean floor"@en,
        "海床"@zh,
        "海底"@zh .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:plunge_pool rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :planetary_erosion ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :hydroform,
        :water_body ;
    :has_definition "A hollow eroded by the force of the falling water at the base of a waterfall, particularly by the eddying effect."^^xsd:string ;
    :has_exact_synonym "PLUNGE POOL"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polynya rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :land_ice_mass ;
                            rdf:rest [ rdf:first :pack_ice_mass ;
                                    rdf:rest :nil ] ] ] ],
        :sea_surface_layer ;
    :has_definition "A sea surface layer which is 1) not covered by ice and 2) laterally surrounded by either pack ice or land and pack ice."@en ;
    :has_exact_synonym "POLYNA"^^xsd:string,
        "Polynya"^^xsd:string,
        "polynia"^^xsd:string,
        "Polyn'ya"@en ;
    :has_related_synonym "big clearing"^^xsd:string,
        "clearing"^^xsd:string,
        "glade"^^xsd:string,
        "ice clearing"^^xsd:string,
        "regional clearing"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sea_shore rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :sea_coast ],
        :shore ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :shore ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :overlaps ;
                                    owl:someValuesFrom :sea_coast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "That part of the land in immediate contact with a sea, including the intertidal zone."^^xsd:string ;
    :has_related_synonym "shore"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:shoreline rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :shore ],
        :two_dimensional_continuant_fiat_boundary ;
    :has_definition "A two-dimensional continuant fiat boundary which is located between a landmass and a water body."^^xsd:string ;
    :has_exact_synonym "Shoreline"^^xsd:string,
        "Küstenlinie"@de,
        "línea costera"@es,
        "linea costiera"@it ;
    :has_narrow_synonym "海岸線"@zh ;
    :has_related_synonym "SHOR"^^xsd:string,
        "coastline"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:paternoster_lake rdfs:subClassOf :glacial_lake ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "One of a series of glacial lakes connected by a single stream or a braided stream system."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:glacial_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :meltwater ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :glacial_erosion_process ],
        :lake ;
    :has_definition "A lake which is primarily composed of glacial meltwater and which fills a depression formed as a result of a glacial erosion process."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:palsa rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :wetland_ecosystem ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom :permafrost ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ice_lens ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :surrounded_by ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :permafrost ;
                                                            rdf:rest [ rdf:first :soil ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :frost_heave ;
    :has_definition "A frost heave which is formed as the result of a perennial ice lens forming under soil, pushing a roughly oval portion land surface upwards."^^xsd:string ;
    :has_exact_synonym "palsa bog"^^xsd:string,
        "palsamoor" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:consequent_stream rdfs:subClassOf :stream ;
    :has_definition "A stream whose course is a direct consequence of the original slope of the surface upon which it developed, i.e., a stream that follows the slope of the original land."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subsequent_stream rdfs:subClassOf :stream ;
    :has_definition "A stream whose course has been determined by selective headward erosion along weak strata. These streams have generally developed after the original stream. Subsequent streams developed independently of the original relief of the land and generally follow paths determined by the weak rock belts."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:resequent_stream rdfs:subClassOf :stream ;
    :has_definition "A stream whose course follows the original relief, but at a lower level than the original slope (e.g., flows down a course determined by the underlying strata in the same direction). These streams develop later and are generally a tributary to a subsequent stream."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:obsequent_stream rdfs:subClassOf :stream ;
    :has_broad_synonym "watercourse"^^xsd:string ;
    :has_definition "A stream flowing in the opposite direction of the consequent drainage."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:insequent_stream rdfs:subClassOf :stream ;
    :has_definition "A stream that has an almost random drainage often forming dendritic patterns. These are typically tributaries and have developed by a headward erosion on a horizontally stratified belt or on homogeneous rocks. These streams follow courses that apparently were not controlled by the original slope of the surface, its structure or the type of rock."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tributary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :tributary_of ;
            owl:someValuesFrom :hydrographic_feature ],
        :stream ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :stream ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :tributary_of ;
                                    owl:someValuesFrom :hydrographic_feature ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "stream"^^xsd:string,
        "watercourse"^^xsd:string ;
    :has_definition "A stream or river which flows into another river (a parent river) or body of water but which may not flow directly into the sea."^^xsd:string ;
    :has_exact_synonym "affluent"^^xsd:string ;
    :has_related_synonym "affluent stream"^^xsd:string,
        "confluent stream"^^xsd:string,
        "river tributary"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rill rdfs:subClassOf :depressed_landform,
        :surface_landform ;
    :has_definition "A narrow and shallow incision into soil resulting from erosion by overland flow that has been focused into a thin thread by soil surface roughness. Rilling, the process of rill formation, is common on agricultural land and unvegetated ground."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rincon rdfs:subClassOf :meander ;
    :has_definition "An incised meander on a river."^^xsd:string ;
    :has_related_synonym "inlet"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_dike rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :dike,
        :igneous_intrusion ;
    :has_broad_synonym "ridge"^^xsd:string ;
    :has_definition "An intrusive igneous body. Its thickness is usually much smaller than its other two dimensions. Thickness can vary from sub-centimeter scale to many meters in thickness and the lateral dimensions can extend over many kilometers. A dike is an intrusion into a cross-cutting fissure, meaning a dike cuts across other pre-existing layers or bodies of rock, this means that a dike is always younger than the rocks that contain it. Dikes are usually high angle to near vertical in orientation, but subsequent tectonic deformation may rotate the sequence of strata through which the dike lies so that the latter becomes horizontal."^^xsd:string ;
    :has_exact_synonym "dyke (geologic)"^^xsd:string,
        "igneous dike",
        "volcanic dyke"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:trough rdfs:subClassOf :depressed_landform ;
    :has_definition "A linear structural depression that extends laterally over a distance, while being less steep than a trench. A trough can be a narrow basin or a geologic rift. There are various oceanic troughs, troughs found under oceans; examples include the rift along the mid-oceanic ridge and the Cayman Trough."^^xsd:string ;
    :has_related_synonym "swale"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:beaver_dam rdfs:subClassOf :animal_habitation ;
    :has_broad_synonym "dam"^^xsd:string ;
    :has_definition "An obstruction in a stream constructed by a beaver."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:submerged_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :depressed_landform ],
        :solid_surface_layer,
        :surface_of_an_astronomical_body ;
    :has_broad_synonym "BOTTOM"^^xsd:string ;
    :has_definition "The portion of the ground surface which lies below water."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:container_of_an_intermittent_saline_lake rdfs:subClassOf :container_of_an_intermittent_lake ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A depression that is periodically filled with saline water, forming a saline lake."^^xsd:string ;
    :has_exact_synonym "intermittent saline lake",
        "intermittent salt lake"^^xsd:string,
        "intermittent salt lakes"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:container_of_an_intermittent_oxbow_lake rdfs:subClassOf :container_of_an_intermittent_lake,
        :oxbow_lake ;
    :has_definition "A depression which is continous with one or more abandoned meander loops of a river channel."^^xsd:string ;
    :has_exact_synonym "intermittent oxbow lake" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:container_of_an_intermittent_pond rdfs:subClassOf :container_of_an_intermittent_water_body ;
    :has_definition "A container of an intermittent water body which, when filled with water, has a well-illuminated surface layer, is subject to complete mixing of the water it holds, and is smaller than the container of a lake."^^xsd:string ;
    :has_exact_synonym "intermittent pond"^^xsd:string,
        "intermittent ponds"^^xsd:string,
        "intermittent pool"^^xsd:string ;
    :has_narrow_synonym "intermittent pool"^^xsd:string ;
    :has_related_synonym "intermittent pool"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:underground_irrigation_canal rdfs:subClassOf :irrigation_canal,
        :underground_water_body ;
    :has_definition "A gently inclined underground tunnel bringing water for irrigation from an aquifer."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:intermittently_filled_reservoir rdfs:subClassOf :container_of_an_intermittent_water_body ;
    :has_definition "A reservoir that is not permanently filled with water, at times being dry."^^xsd:string ;
    :has_exact_synonym "intermittent reservoir"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wadi_mouth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :wadi ],
        :mouth ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mouth ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :wadi ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The lower terminus of a wadi where it widens into an adjoining floodplain, depression, or water body."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
