    :has_narrow_synonym "bench"^^xsd:string,
        "bench (seafloor)"^^xsd:string ;
    :has_related_synonym "marine bench"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

