    :has_definition "A gentle slope, with a generally smooth surface, particularly found around groups of islands and seamounts."^^xsd:string ;
    :has_related_synonym "apron (geological)"^^xsd:string,
        "archipelago apron"^^xsd:string,
        "undersea apron"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_cap_depression rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ice_cap ],
        :depressed_landform,
        :surface_landform ;
