            owl:onProperty :contains_process ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :water_accumulation_process ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :has_participant ;
                                                            owl:someValuesFrom :saline_evaporation_pond ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :discontinuous ] ;
                                    rdf:rest :nil ] ] ] ],
        :container_of_an_intermittent_pond ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_exact_synonym "intermittent salt pond"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:landfill rdfs:subClassOf :depressed_landform,
        :surface_landform ;
