    :has_exact_synonym "Deponie"@de,
        "garbage dump"@en,
        "rubbish dump"@en,
        "vertedero"@es,
        "discarica"@it,
        "垃圾掩埋場"@zh ;
    :has_related_synonym "disposal site"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riverine_pothole rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cylindrical ;
                            rdf:rest [ rdf:first :u_shaped ;
                                    rdf:rest [ rdf:first :tubular ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :solid_surface_layer ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :smooth ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :rock ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :watercourse ],
        :depressed_landform,
        :surface_landform ;
    :has_broad_synonym "churn hole"@en,
        "evorsion"@en,
        "kettle"@en,
        "pot"@en,
        "rock mill"@en ;
    :has_exact_synonym "eddy mill"@en,
        "giant's kettle"@en,
        "kolk"@en,
        "stream kettle"@en,
        "swirlhole"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:weir rdfs:subClassOf :dam ;
    :has_definition "A low obstruction built across the path of s stream to raise its level."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:moatan rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :hydrographic_feature ],
        :depressed_landform ;
    :has_definition "An annular depression that may not be continuous, located at the base of many seamounts, islands, and other isolated elevations."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:boulder_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :boulder ],
        :elevated_landform,
        :surface_landform ;
    :has_definition "A high altitude or high latitude bare, flat area covered with large angular rocks."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:arrugado rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :marine_water_body ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sea_floor ],
        :surface_landform ;
    :has_definition "An undersea area of subdued corrugations."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:geographic_sill rdfs:subClassOf :depressed_landform ;
    :has_broad_synonym "sill" ;
    :has_definition "The low part of a gap or saddle separating basins."^^xsd:string ;
    :has_related_synonym "gap"^^xsd:string,
        "sill",
        "sill (physiographic)"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brackish_lake rdfs:subClassOf :brackish_water_body,
        :saline_lake ;
    :has_definition "A lake which is primarily composed of brackish water, having a higher salinity than fresh water but a lower salinity than marine water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brackish_pond rdfs:subClassOf :brackish_water_body,
        :pond ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :pond ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :brackish_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A pond which is composed primarily of brackish water."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:kame rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :sand ;
                                            rdf:rest [ rdf:first :gravel ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :stratified ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :layer ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :sand ;
                                                            rdf:rest [ rdf:first :gravel ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :elevated_landform,
        :surface_landform ;
    :has_broad_synonym "mount"^^xsd:string,
        "ridge"^^xsd:string ;
    :has_definition "An irregularly shaped hill or mound composed of sorted or stratified sand and gravel that is deposited in contact with the glacial ice. It can have an irregular shape. Kames are often associated with kettles, and this is referred to as kame and kettle topography. When the ice retreats further, the delta kame often collapses. Kame terraces are frequently found along the side of a glacial valley and are the deposits of meltwater streams flowing between the ice and the adjacent valley side."^^xsd:string .

