    :has_definition "A man-made watercourse, or makeshift aqueduct, often an artificial channel which supplies water to a watermill or its mill pond, collecting water from upstream of the mill so that the natural level of the driving water is above the level of the stream at the mill. Alternatively to may deliver water for mineral washing and concentration, irrigation or to a dye works."^^xsd:string ;
    :has_exact_synonym "lete"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
