            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :lake ],
        :sediment ;
    :has_definition "Lake sediment is sediment which covers the bottom of a lake. Lake sediments are comprised mainly of clastic material (sediment of clay, silt, and sand sizes), organic debris, chemical precipitates, or combinations of these."^^xsd:string ;
    :has_related_synonym "SedimentLayer"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:waterhole rdfs:subClassOf :pond ;
    :has_definition "A pond, often temporary or seasonal, used as a drinking place by mammals and birds."^^xsd:string ;
    :has_exact_synonym "water hole"^^xsd:string ;
    :has_related_synonym "water hole"^^xsd:string,
        "waterhole"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:gravel_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :gravel ],
        :field ;
    :has_definition "A field which is composed primarily of gravel."@en ;
    :has_related_synonym "gravel field area"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:container_of_an_intermittent_water_body rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_accumulation_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :discontinuous ] ;
                                    rdf:rest :nil ] ] ] ],
        :depressed_landform,
        :surface_landform ;
    :has_definition "A depression which is is periodically filled with water when water supply exceeds evapotranspiration and bed seepage."^^xsd:string ;
    :has_exact_synonym "intermittent body of water"^^xsd:string,
        "intermittent water body" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:range_of_seamounts rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :seamount ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :marine_water_body ],
        :mountain_range ;
    :has_definition "A mountain range which is submerged under a marine water body."@en ;
    :has_related_synonym "cordillera"^^xsd:string,
        "seamount chain"^^xsd:string,
        "seamount group"^^xsd:string,
        "seamount range"^^xsd:string,
        "undersea cordillera"^^xsd:string,
        "undersea mountain chain"^^xsd:string,
        "undersea range"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:endorheic_basin rdfs:subClassOf :drainage_basin ;
    :has_definition "A drainage basin from which there is no outflow of water, either on the surface as rivers, or underground by flow or diffusion through rock or permeable material."^^xsd:string ;
    :has_related_synonym "closed basin"^^xsd:string,
        "terminal basin"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:talik rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :permafrost ],
        [ owl:complementOf :permafrost ],
        :part_of_a_landmass,
        :surface_landform ;
    :has_definition "An area of unfrozen ground surrounded by permafrost."^^xsd:string ;
    :has_exact_synonym "Talik"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:multipurpose_dam rdfs:subClassOf :dam ;
    :has_definition "A dam constructed for more than one purpose."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saddle_dam rdfs:subClassOf :dam ;
    :has_definition "An auxiliary dam constructed to confine the reservoir created by a primary dam either to permit a higher water elevation and storage or to limit the extent of a reservoir for increased efficiency."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:check_dam rdfs:subClassOf :dam ;
    :has_definition "A dam designed to reduce flow velocity and control soil erosion."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wing_dam rdfs:subClassOf :dam ;
    :has_definition "A dam that only partly restricts a waterway, creating a faster channel that resists the accumulation of sediment."^^xsd:string .
